INSERT INTO `qs_course` VALUES ('2395','10','72624','国际化妆造型全能班','2','长沙玩美化妆美甲培训学校','381','20','其他技能培训','1884','全日制','0','','19','312','湖南省/长沙市','对化妆造型感兴趣或者想从事专业的化妆造型工作','高级职业资格等级证书','四个月','0','0','从化妆基础知识，化妆品和化妆工具的认识，五官化妆及五官纠正，化妆与色彩的配合，主要学习妆面包括有:裸妆,生活妆,保守职业妆,非保守职业妆,小烟熏,晚宴妆,前移后移化妆技法,新娘妆,鲜花新娘,时尚新娘,韩式新娘,走秀新娘,抓纱新娘,中式新娘,西式新娘,室内摄影新娘,室外摄影新娘,时尚晚宴,典雅晚宴,黑白摄影,彩色摄影,冷妆,暧妆,新郎妆,男主持妆,T台男模,女主持人妆,娱乐女主持人妆,中烟熏,大烟熏,自然光摄影妆,摄影古装,T台模特妆,骨骼妆,胖的化妆技巧，浪漫妆,清纯妆,潇洒妆,典雅妆,时尚妆,欧式妆,小倒勾,印度妆,新闻主持妆,综艺主持人妆,日本艺妓妆,中老年人化妆技巧,老年妆,不同季节的化妆技巧,广告化妆,平面模特妆,老年化青年,梦幻妆,芭比妆,鬼妆,小丑妆,创意妆,黑人妆,格格妆,时尚中国风,浪漫田园风,时尚英伦风,旗袍,复古新娘,高贵新娘,浪漫新娘,简约新娘,猫眼妆,媚紫晚礼,宫廷妆,清朝妆,汉朝妆,唐妆,60年代的妆面,复古妆,桃花妆,哥特妆,吸血鬼妆,抢伤的塑造,断指的塑造,刀伤的塑造,淤青的塑造等，盘发造型和妆面的结合及运用，从基础手法（头部分区、马尾、拧绳、倒梳、扎发、花卷、拧发、卷筒、拧包、编发）到整体发型的学习，学习方式由理论和实践相结合，让同学们撑握化妆造型的整体运作。','0','1441533085','1451901085','1441533085','0','0','','2','1','1','国际化妆造型全能班 长沙玩美化妆美甲培训学校  高级职业资格等级证书 国际00 国际化0 化妆00 造型00 全能00 班长00 长沙00 美化00 美甲00 培训00 学校00 高级00 职业00 资格00 等级00 等级证0 证书00 其他00 技能00 湖南00 湖南省0 长沙市0 沙市00 基础00 知识00 化妆品0 工具00 认识00 五官00 官化00 纠正00 色彩00 配合00 主要00 学习00 面包00 包括00 生活00 保守00 晚宴00 前移00 后移00 技法00 新娘00 鲜花00 时尚00 韩式00 中式00 西式00 室内00 摄影00 室外00 典雅00 黑白00 彩色00 新郎00 主持00 男模00 主持人0 娱乐00 大烟00 自然00 自然光0 古装00 T台模特 模特00 骨骼00 技巧00 浪漫00 清纯00 潇洒00 欧式00 印度00 新闻00 综艺00 日本00 中老00 中老年0 老年00 老年人0 人化00 不同00 季节00 广告00 平面00 平面模特 青年00 梦幻00 芭比00 小丑00 创意00 黑人00 格格00 中国00 国风00 田园00 英伦00 旗袍00 复古00 高贵00 简约00 猫眼00 宫廷00 清朝00 汉朝00 桃花00 吸血鬼0 塑造00 断指00 盘发00 面的00 结合00 运用00 手法00 头部00 部分00 分区00 马尾00 卷筒00 编发00 整体00 发型00 方式00 理论00 实践00 同学00 运作00','国际化妆造型全能班,长沙玩美化妆美甲培训学校,,高级职业资格等级证书','','0.000000','0.000000','1','1','0');
INSERT INTO `qs_course` VALUES ('2396','0','72259','杭州滨江办公软件培训、office办公自动化培训到汇星教育','2','杭州市滨江区汇星教育咨询服务部','420','11','IT培训','1880','随到随学','0','','12','213','浙江省/杭州市','公司管理人员、企业白领、社会待业人员、学校毕业生','计算机等级认证','45','1280','200','课程目标\r\n通过对计算机操作、常用办公软件、计算机病毒防治、多媒体演示、网络知识、电子商务和常用应用软件的学习，使得学员可以全面获得办公室白领工作所需的计算机技能，熟练使用计算机完成各种工作。\r\n招生对象 :\r\n未就业大、中专学生，计划跳槽人员；需要获得计算机基础应用能力的人员；零基础人员。\r\n计算机入门基础课程 键盘操作、指法练习；五笔字型汉字输入法的学习 \r\n计算机操作系统基础 学习Windows 操作系统基础，操作系统的基本设置，软件的安装和卸载。 \r\nMicrosoft Word 文本编辑、段落设置、图形应用、表格应用、商务办公中的应用，体验Word应用规则及扩展功能，用Word提高文书处理能力，快速、规范地制作公文，模板和文体风格，学会编辑文档应有的技巧。学会制作会议通知，会议日程表，图文并茂的邀请函等。\r\nMicrosoft Excel 数据格式、公式函数、图表分析、数据分析、体验数据分析效果，建立行为规范，保证建表质量。用图表进行数据分析，对表格数据进行筛选和排序，对表格数据进行统计分析。 \r\nMicrosoft PowerPoint 专业幻灯片、演示文稿的制作，表格的创建，使用绘图工具PPT的视图切换，幻灯片放映和打印，使用PowerPoint中的模板和母版，文本编辑以及PPT在Office家族和办公组合的应用。 \r\n电子邮件的收发 学会申请免费电子邮箱，收发各类邮件等。 \r\n计算机网络基础 网络的基本概念，IP地址的分配，网络资源（文件、打印机）的共享和使用。上网的基本设置等 \r\n常见问题的处理 软件安装，故障排除，病毒查杀，病毒库的安装和升级，出现病毒感染后的处理等。','1441468800','1441591285','1444183285','1441591285','0','0','','2','1','1','杭州滨江办公软件培训、office办公自动化培训到汇星教育 杭州市滨江区汇星教育咨询服务部  计算机等级认证 杭州00 滨江00 办公00 软件00 培训00 自动00 自动化0 教育00 杭州市0 州市00 咨询00 服务00 服务部0 计算00 计算机0 等级00 认证00 IT000 浙江00 浙江省0 课程00 目标00 通过00 操作00 常用00 病毒00 防治00 多媒体0 媒体00 演示00 网络00 知识00 电子00 电子商务 商务00 应用00 学习00 使得00 学员00 可以00 全面00 获得00 办公室0 白领00 领工00 工作00 技能00 熟练00 使用00 完成00 各种00 招生00 对象00 就业00 中专00 学生00 计划00 跳槽00 人员00 需要00 基础00 能力00 零基00 入门00 基础课0 键盘00 指法00 练习00 五笔字0 字型00 汉字00 输入00 输入法0 系统00 基本00 设置00 安装00 卸载00 文本00 编辑00 段落00 图形00 表格00 体验00 规则00 扩展00 功能00 提高00 高文00 文书00 处理00 快速00 规范00 制作00 公文00 模板00 和文00 文体00 风格00 学会00 文档00 应有00 有的00 技巧00 会议00 通知00 日程00 日程表0 图文00 并茂00 邀请00 邀请函0 数据00 格式00 公式00 函数00 图表00 分析00 数据分析 效果00 建立00 立行00 行为00 保证00 质量00 进行00 筛选00 排序00 统计00 计分00 专业00 幻灯00 幻灯片0 文稿00 创建00 绘图00 工具00 切换00 放映00 打印00 以及00 家族00 组合00 邮件00 收发00 申请00 免费00 邮箱00 各类00 概念00 地址00 分配00 资源00 文件00 打印机0 印机00 共享00 上网00 常见00 问题00 故障00 排除00 查杀00 病毒库0 升级00 出现00 感染00','杭州滨江办公软件培训、office办公自动化培训到汇星教育,杭州市滨江区汇星教育咨询服务部,,计算机等级认证','','120.160597','30.18601