INSERT INTO `qs_course` VALUES ('2397','0','72217','国家承认学历报考马上就结束了   富海教育','2','大连富海计算机专修学校','314','30','专升本','1881','白天班','0','','8','165','辽宁省/大连市','初中以上','','20000','10800','10800','进入九月，2015年便走入最后的三分之一。奋斗过春夏，你是否做好准备迎接秋的到来？\r\n2015年成人高考报名工作马上截至了。 已报名学员9月10日之后会陆续通知去教育局照相，10月24.25考试时间。合理安排时间\r\n\r\n   温馨提示：国家承认学历是一个慢过程，不是非要用到的时候先着急的事情\r\n教育改革在即：从2016年开始，想要拿一纸文凭将变得相当困难，不但费用增加，操作的难度同样要大大增加，如果你确定这辈子学历对你来说，毫无作用，那么恭喜你，无需为此烦恼！如果你还想要升职、加薪、跳槽、参加国家考试，那么请你重视起来，，早报名，早拿证！早受益！','1442160000','1441591535','1467511535','1441591535','0','0','','1','1','3','国家承认学历报考马上就结束了  富海教育 大连富海计算机专修学校 国家00 承认00 学历00 报考00 马上00 结束00 教育00 大连00 计算00 计算机0 专修00 修学00 学校00 专升本0 辽宁00 辽宁省0 进入00 九月00 奋斗00 是否00 做好00 准备00 迎接00 到来00 考试00 时间00 合理00 安排00 温馨00 提示00 一个00 过程00 不是00 是非00 用到00 时候00 着急00 事情00 想要00 文凭00 变得00 相当00 困难00 不但00 费用00 增加00 操作00 难度00 同样00 大大00 大增00 如果00 确定00 辈子00 子学00 来说00 毫无00 作用00 那么00 恭喜00 无需00 为此00 烦恼00 升职00 跳槽00 参加00 参加国0 重视00 起来00 早报00 报名00 受益00','国家承认学历报考马上就结束了   富海教育,大连富海计算机专修学校,,','','0.000000','0.000000','1','4','0');
INSERT INTO `qs_course` VALUES ('2398','0','72259','杭州滨江CAD建筑机械设计培训就到汇星技术学校，名师实训。','2','杭州市滨江区汇星教育咨询服务部','420','11','IT培训','1880','随到随学','0','','12','213','浙江省/杭州市','CAD建筑图纸设计、机械图纸平面及CAD三维设计、CAD石材制图、室内外建筑效果图设计','CAD建筑设计师证书、CAD机械设计师证书','45','1280','1180','AutoCAD制图专业：\r\n建筑施工CAD：\r\nAutoCAD2010软件介绍、基本绘图界面设置、各种平面绘图工具与命令的使用方法及技巧、图层标注，实际建筑制图技巧(墙体、门窗、各种家具图的导入等);\r\n原始结构图、拆墙、砌墙图、平面布置图、地板布置图、天花板布置图、开关和插座布置图、水路布置图、配电系统图、衣柜鞋柜立面图、电视背景墙立面图、书柜立面图、实际量房注意事项、工程预算、打印输出等\r\n机械设计CAD：\r\nAutoCAD2010软件介绍、绘图界面设置、各种平面绘图工具与命令的使用方法及技巧、图层标注、图块应用、机械制图、建筑平面图绘制、轴测图绘制、三维实体模型的绘制、三维曲面模型的绘制、标准三视图的绘制、图形材质应用与图形的渲染、实物绘制技巧、工程机械图打印输出\r\n室内装潢设计专业：\r\n第1阶段：建筑施工CAD：\r\nAutoCAD2010软件介绍、基本绘图界面设置、各种平面绘图工具与命令的使用方法及技巧、图层标注，实际建筑制图技巧(墙体、门窗、各种家具图的导入等);\r\n原始结构图、拆墙、砌墙图、平面布置图、地板布置图、天花板布置图、开关和插座布置图、水路布置图、配电系统图、衣柜鞋柜立面图、电视背景墙立面图、书柜立面图、实际量房注意事项、工程预算、打印输出等；\r\n第2阶段：3Dmax设计：\r\n2D基本操作绘图绘制、编辑3D建模及编辑，基本材质及贴图，原合材质贴图，动画及后期制作的静态合成，灯光应用，环境光的使用，配影的制作，相机的使用与渲染。\r\n第3阶段：VRay渲染阶段：\r\n学习Vray渲染器的使用,全局光照明、景深效果、HDRI动态范围贴图、焦散效果、运动模糊效果、置换特效、毛发特效、灯光、材质的使用等\r\n第4阶段：Photoshop后期效果处理：\r\nA、photoshopCS软件系统介绍 B、各种图形工具的使用方法及技巧 C、照片处理、图像合成 D、文字效果处理 E、婚纱效果图设计、F、图层的使用 G、图层样式 H、图层混合模式 I、图层蒙版 J、通道 K、滤镜的使用技巧等\r\n任课老师有丰富设计经验，教你的不只是软件，是实在的运用，在校期间有大量作业，让你提前获得岗位经验，让你学完就可以就业。','1441036800','1441591636','1446775636','1441591636','0','0','','2','1','1','杭州滨江CAD建筑机械设计培训就到汇星技术学校，名师实训。 杭州市滨江区汇星教育咨询服务部  CAD建筑设计师证书、CAD机械设计师证书 杭州00 滨江00 AD000 建筑00 机械00 机械设计 设计00 培训00 技术00 技术学0 学校00 名师00 杭州市0 州市00 教育00 咨询00 服务00 服务部0 建筑设计 建筑设计师 设计师0 证书00 机械设计师 IT000 浙江00 浙江省0 CAD制图 制图00 专业00 施工00 基本00 绘图00 界面00 设置00 各种00 平面00 工具00 命令00 使用00 方法00 技巧00 标注00 实际00 墙体00 门窗00 家具00 导入00 原始00 结构00 结构图0 构图00 布置00 地板00 天花00 天花板0 开关00 插座00 水路00 配电00 系统00 衣柜00 鞋柜00 立面00 电视00 背景00 书柜00 注意00 事项00 工程00 工程预算 预算00 打印00 输出00 应用00 机械制图 平面图0 绘制00 三维00 实体00 模型00 曲面00 标准00 图形00 材质00 渲染00 实物00 工程机0 室内00 装潢00 阶段00 操作00 编辑00 建模00 贴图00 动画00 后期00 后期制作 制作00 静态00 合成00 灯光00 环境00 相机00 学习00 全局00 光照00 照明00 景深00 效果00 动态00 范围00 运动00 模糊00 置换00 特效00 毛发00 处理00 软件00 介绍00 照片00 图像00 文字00 婚纱00 效果图0 效果图设计 样式00 混合00 模式00 通道