INSERT INTO `qs_course` VALUES ('2399','0','71879','教你如何处理淘宝店铺评价','2','山东深泉职业培训学院','271','20','其他技能培训','1881','白天班','0','','16','0','山东省','本科毕业生，大专毕业生','','45','1','1','评价是店铺营销的重要组成部分，事关店铺生死大事。出现中差评了，很多人会觉得交给客服处理就可以了，其实不然。要知道，一个针对爆款的恶意评价可以直接搞死一家店。所以，卖家们一定要重视，养成一个习惯――如果一个宝贝转化率降低了，看看爆款和销量前三的宝贝评价有没有问题。一旦发现评价的问题，一定要尽快解决。一旦处理不好，店铺做其他任何补救措施都是没用的，所以今天深泉电商的小公举来教你如何解决这些问题~\r\n&#160;\r\n一般来说，我们要尤其重视重要宝贝的前三条评价。如果这三条都是好评，就可以放心很多了，但如果有一条不良的评论，甚至排名第一的就是一个大大的问题评价，说宝贝这不好那不好的，就要引起重视。不然，你的宝贝转化率会大大降低。而且很重要一点，主推宝贝的转化率折损，会影响到其他与它关联的宝贝，导致整个店铺的转化下降、客单价降低。\r\n&#160;\r\n根据评价改进品质\r\n&#160;\r\n客户之所以给出中差评以及恶意好评，一般来说有两种情况：\r\n&#160;\r\n第一种，他对你的宝贝和服务有意见，把他自己的认知说出来，实话实说;\r\n&#160;\r\n第二种，他给出不良评价，期待更多的利益。比如差评师、比如同行等。\r\n&#160;\r\n其实绝大部分中差评，还是第一种，而他给出的负面评价，其实信息量很大，能够帮助你发现产品和服务的问题，以便快速改进改正，从而使你变得更强，比竞争对手更优质。\r\n&#160;\r\n差评师、同行和挑剔型客户基本上也都会针对你的宝贝弱点进行批评，一开始你是分辨不出来的。虚心接受，迅速改进，能够帮助你亡羊补牢，不要再面对不断涌现出来的问题。如果实在没法改善品质，那么请改善描述。不要把你的宝贝描述的太夸张，和实际相符一点，这样会很大程度降低中差评概率。','0','1441592714','1451960714','1441592714','0','0','','1','1','3','教你如何处理淘宝店铺评价 山东深泉职业培训学院  如何00 何处00 处理00 店铺00 评价00 山东00 职业00 培训00 学院00 其他00 技能00 山东省0 营销00 重要00 组成00 成部00 部分00 事关00 生死00 大事00 出现00 多人00 觉得00 交给00 客服00 可以00 其实00 不然00 知道00 一个00 针对00 恶意00 直接00 一家00 所以00 卖家00 一定00 重视00 养成00 习惯00 如果00 宝贝00 转化00 转化率0 降低00 看看00 销量00 有没有0 没有00 问题00 一旦00 发现00 尽快00 解决00 不好00 任何00 补救00 措施00 没用00 今天00 电商00 这些00 一般00 来说00 我们00 尤其00 三条00 好评00 放心00 不良00 评论00 甚至00 排名00 第一00 就是00 大大00 大大的0 这不00 就要00 引起00 起重00 而且00 一点00 主推00 影响00 关联00 导致00 整个00 下降00 单价00 根据00 改进00 品质00 客户00 之所以0 给出00 以及00 情况00 和服00 服务00 有意00 意见00 自己00 认知00 说出00 出来00 实话00 第二00 期待00 更多00 利益00 比如00 如同00 同行00 绝大00 大部00 大部分0 还是00 负面00 信息00 信息量0 很大00 能够00 帮助00 产品00 以便00 快速00 改正00 从而00 变得00 竞争00 对手00 优质00 挑剔00 基本00 基本上0 弱点00 进行00 批评00 开始00 分辨00 虚心00 接受00 迅速00 亡羊00 不要00 面对00 不断00 涌现00 现出00 果实00 实在00 没法00 改善00 那么00 描述00 夸张00 实际00 相符00 这样00 程度00 概率00','教你如何处理淘宝店铺评价,山东深泉职业培训学院,,','','0.000000','0.000000','1','1','0');
INSERT INTO `qs_course` VALUES ('2400','0','73312','杂粮煎饼技术','2','聊城鲁妈妈小吃培训学校','421','14','餐饮培训','1880','随到随学','0','','16','275','山东省/聊城市','创业人员','','2','680','0','山东杂粮煎饼介绍：山东杂粮煎饼果子为天津传统地方名吃之一，在全国也是出了名的地方美食。每天早上你可以看到几乎每家煎饼果子摊上都是食者不断，有时还需等十几分钟才能拿到，咬上一口香脆可口，口味更是浓淡相宜，再配上一袋原磨豆浆简直就是营养早餐绝佳选择。\r\n　　鲁妈妈小吃培训学校精心推出山东杂粮煎饼果子技术项目，在保留山东杂粮煎饼果子原有配料、口味的基础上，加入了新的核心配料和制作工艺，使得煎饼果子的口味提升了一个档次，凡是品尝过鲁妈妈煎饼果子的顾客无不称赞，都成为了我们的回头客。我们聘请专业的煎饼果子制作经验的师傅担任我们的技术培训师，现场手把手式的教学，核心配方丝毫不做保留，让你完完整整的学到全套最正宗的杂粮煎饼果子技术。选择杂粮煎饼果子就是拥有财富大门的金钥匙，年入8万的滚滚红利等着您！\r\n\r\n \r\n\r\n二 鲁妈妈特色小吃―山东煎饼培训内容： \r\n 培训课程安排 \r\n\r\n理论学习：\r\n1.开店流程讲解，包括店面的选址、人员配备、物资采购等。\r\n2.项目技术详细批解，包括原材料的选择，采购，口味的变换、配比等。\r\n3.店铺经营小技巧，轻松创造财富。\r\n\r\n示范讲解：\r\n1.专业老师一对一的实战示范，讲解技术。\r\n2.老师实践操作中带领你回忆理论学习阶段中的开店的技巧，原材料的选择，采购，成本、预算。\r\n\r\n自我实践：\r\n1.备原材料，老师旁边检查指导。\r\n2.自己操作所有流程，制作出成品，老师旁边检查指导。\r\n3.学员自我思索，老师引导，熟透操作流程。 \r\n \r\n实际操作内容 \r\n\r\n1.培训山东杂粮煎饼的原料、配料及机器的选取、初加工与保存。 \r\n2.培训各种山东杂粮煎饼酱料的选材、配方、配比。 \r\n3.培训山东杂粮煎饼面糊的制作。 \r\n4 培训山东杂粮煎饼的烘烤制作技术。 \r\n5.培训山东杂粮煎饼附加值材料的加工组合技术。 \r\n \r\n培训时间  不限制学习时间,包教包会,学会为止。一般2-3天左右，视个人情况而定。 \r\n\r\n\r\n三 技术支持―鲁妈妈特色小吃培训\r\n\r\n1.专业的老师，一对一的教你开店技术，开店方案\r\n2.切实的指导店面招牌的设计\r\n3.全面的指导个性化菜单设计\r\n4.终身免费技术升级，强大的学员信息数据管理技术支持','0','1441593015','1467513015','1441593015','0','0','','2','1','1','杂粮煎饼技术 聊城鲁妈妈小吃培训学校  杂粮00 煎饼00 技术00 聊城00 妈妈00 小吃00 培训00 学校00 餐饮00 山东00 山东省0 城市00 介绍00 果子00 天津00 传统00 地方00 名吃00 之一00 全国00 美食00 每天00 早上00 可以00 看到00 几乎00 每家00 食者00 不断00 有时00 十几00 分钟00 才能00 拿到00 口香00 可口00 口味00 更是00 浓淡00 相宜00 豆浆00 简直00 就是00 营养00 早餐00 绝佳00 选择00 精心00 推出00 出山00 项目00 保留00 原有00 配料00 基础00 加入00 核心00 制作00 制作工0 作工00 工艺00 使得00 提升00 一个00 档次00 凡是00 品尝00 顾客00 无不00 称赞00 成为00 为了00 我们00 回头00 回头客0 聘请00 专业00 经验00 师傅00 担任00 技术培训师 培训师0 现场00 手把00 手把手0 把手00 教学00 配方00 丝毫00 毫不00 完完00 完整00 整整00 学到00 全套00 正宗00 拥有00 财富00 大门00 金钥匙0 钥匙00 滚滚00 红利00 特色00 内容00 课程00 安排00 理论00 学习00 开店00 流程00 讲解00 包括00 店面00 面的00 选址00 人员00 配备00 物资00 采购00 详细00 原材00 原材料0 材料00 变换00 配比00 店铺00 经营00 技巧00 轻松00 创造00 示范00 老师00 一对一0 实战00 实践00 操作00 带领00 回忆00 阶段00 成本00 预算00 自我00 旁边00 边检00 检查00 指导00 自己00 