INSERT INTO `qs_course` VALUES ('2401','0','72259','杭州平面设计+网店美工培训，名师实战、汇星值得信赖！','2','杭州市滨江区汇星教育咨询服务部','420','11','IT培训','1880','随到随学','0','','12','213','浙江省/杭州市','平面美工、网页美工、淘宝美工、淘宝(商城)淘宝美工设计师、淘宝店主、淘宝经营者、淘宝平面设计、淘宝网','网页美工设计师证书','60','2680','2480','第十二部分：看懂你的买家才是你的客户――宝贝详情页的布局与设置\r\n1、了解宝贝详情页在店铺中的作用；	 \r\n2、讲解淘宝详情页在店铺中的作用；\r\n3、宝贝详情页的布局；	 \r\n4、宝贝详情页如何布局；\r\n5、宝贝详情页重要信息占比；\r\n6、怎样设置关联宝贝；\r\n7、宝贝详情的制作；\r\n8、宝贝详情页上传；\r\n9、认为低价才能销售；\r\n10、想利用淘宝爆发，不淡定；\r\n\r\n第十三部分：随时联系，你才是大赢家――悬浮旺旺的设置\r\n1、悬浮旺旺的设置；	 \r\n2、怎样设置悬浮旺旺；\r\n3、怎样创建子账号；\r\n4、怎样创建分流组；\r\n5、如何将旺旺制作在图片上；\r\n第十四部分：店铺背景设置 简单又实用――旺铺页面锁定背景\r\n1、了解旺铺背景的设置以及作用；	 \r\n2、旺铺背景的种类；\r\n3、旺铺锁定背景的尺寸；\r\n4、旺铺锁定背景的制作；\r\n5、旺铺锁定背景的添加；\r\n\r\n第十五部分：方便买家 服务买家――回到顶部的设置\r\n\r\n学习目的	 课程大纲\r\n1、回到顶部的作用以及制作；	 \r\n2、回到顶部的作用；\r\n3、回到顶部的设置方法；\r\n\r\n第十六部分：熟能生巧――总结复习\r\n1、店铺装修总结；	 \r\n2、总结常用快捷键；\r\n3、总结店铺装修中上传图片格式；\r\n4、总结店铺装修中所有图片尺寸','0','1441593849','1446777849','1441593849','0','0','','2','1','1','杭州平面设计+网店美工培训，名师实战、汇星值得信赖！ 杭州市滨江区汇星教育咨询服务部  网页美工设计师证书 杭州00 平面00 平面设计 设计00 网店美工 美工00 培训00 名师00 实战00 值得00 信赖00 杭州市0 州市00 滨江00 教育00 咨询00 服务00 服务部0 网页00 网页美工 美工设计 美工设计师 设计师0 证书00 IT000 浙江00 浙江省0 十二00 部分00 买家00 客户00 宝贝00 详情00 布局00 设置00 了解00 店铺00 作用00 讲解00 如何00 重要00 信息00 怎样00 关联00 制作00 上传00 认为00 低价00 才能00 销售00 利用00 爆发00 随时00 联系00 赢家00 悬浮00 创建00 账号00 分流00 图片00 十四00 背景00 简单00 实用00 页面00 锁定00 以及00 种类00 尺寸00 添加00 十五00 五部00 方便00 回到00 到顶00 顶部00 学习00 目的00 课程00 大纲00 用以00 方法00 六部00 总结00 复习00 铺装00 装修00 常用00 快捷00 中上00 格式00 所有00 有图片0','杭州平面设计+网店美工培训，名师实战、汇星值得信赖！,杭州市滨江区汇星教育咨询服务部,,网页美工设计师证书','','120.160597','30.186011','1','1','0');
INSERT INTO `qs_course` VALUES ('2402','0','72455','想升职加薪提升学历到哪报名来值得信赖的烟台开发区光瑞教育','2','烟台光瑞职业培训学校','360','20','其他技能培训','1880','随到随学','0','','16','266','山东省/烟台市','成人','','3个月','0','0','烟台开发区福山芝罘区莱山区莱阳海阳莱州蓬莱龙口 \r\n烟台开发区怎么参加今年的网络教育？2015年烟台网络教育优惠报名进行中，报名赠话费，欢迎咨询烟台光瑞教育！\r\n\r\n全国成人高考报名中，烟台成考报名学历中心报名处，光瑞教育成考免费培训辅导，免费领取考前辅导教材。\r\n\r\n成人高考：文史类，经管类，理工类，医学类，教育类130多个本科专科专业，任您选择，涵盖：会计，人力资源管理，管理学，经济学，机械制造，电气工程，电子技术，英语，学前教育，法学，临床，护理，园林，行政管理等热门专业欢迎踊跃报考，专业的职业规划和指导，欢迎详细咨询。 \r\n国家颁发成人高等教育本专科毕业正书，国家承认学历，学信网查询。\r\n\r\n网络教育，是成人教育学历中的一种（成人教育学历还有自考，成人高考中的函授、夜大，广播电视大学）。是指使用电视及互联网等传播媒体的教学模式，它突破了时空的界线，有别于传统需要往校舍安坐于课室的教学模式。使用这种教学模式的学生，通常是业余进修者。由于不需要到特定地点上课，因此可以随时随地上课。学生亦可以透过电视广播、互联网、辅导专线、课研社、面授（函授）等多种不同管道互助学习。是现代信息技术应用于教育后产生的新概念，即运用网络技术与环境开展的教育。招生对象不受年龄和先前学历限制，为广大已步入社会的群众提供了学历提升的机会。\r\n\r\n\r\n联系地址：烟台开发区泰山路87-5 华明大厦2层（中信银行旁，德胜路口南300米）\r\n公交线路：乘23、205、206路到开发区中信银行站下车对面即是','0','1441595370','1444187370','1441595370','0','0','','2','1','1','想升职加薪提升学历到哪报名来值得信赖的烟台开发区光瑞教育 烟台光瑞职业培训学校  升职00 提升00 升学00 学历00 报名00 值得00 信赖00 烟台00 开发00 开发区0 教育00 职业00 培训00 学校00 其他00 技能00 山东00 山东省0 莱山00 山区00 莱阳00 海阳00 莱州00 蓬莱00 龙口00 怎么00 参加00 今年00 网络00 话费00 欢迎00 咨询00 全国00 成人00 高考00 成考00 名学00 中心00 报名处0 育成00 免费00 辅导00 领取00 考前00 教材00 文史00 经管00 理工00 医学00 医学类0 选择00 涵盖00 会计00 人力00 人力资源 资源00 管理00 管理学0 理学00 经济00 经济学0 机械00 制造00 电气00 工程00 电子00 技术00 英语00 学前00 法学00 临床00 护理00 园林00 行政00 行政管理 热门00 专业00 踊跃00 报考00 规划00 指导00 详细00 国家00 颁发00 高等00 本专科0 专科00 毕业00 承认00 查询00 人教00 教育学0 还有00 自考00 函授00 夜大00 广播00 电视00 大学00 指使00 使用00 用电00 互联00 互联网0 联网00 传播00 媒体00 教学00 模式00 突破00 时空00 界线00 有别00 有别于0 传统00 需要00 校舍00 课室00 这种00 学生00 通常00 业余00 进修00 由于00 特定00 地点00 上课00 因此00 可以00 随时00 随地00 地上00 亦可00 透过00 过电00 专线00 面授00 多种00 不同00 管道00 互助00 助学00 学习00 现代00 信息00 应用00 用于00 产生00 新概念0 概念00 运用00 网络技术 环境00 开展00 招生00 对象00 年龄00 先前00 限制00 广大00 步入00 社会00 群众00 提供00 机会00 联系00 地址00 泰山00 山路00 华明00 大厦00 中信00 银行00 公交00 公交线0 线路00','想升职加薪提升学历到哪报名来值得信赖的烟台开发区光瑞教育,烟台光瑞职业培训学校,,','','0.000000','0.000000','1','1','0');
