INSERT INTO `qs_course` VALUES ('2404','0','72455','汽车维修工证好考吗？报名需要什么资料？烟台福山光瑞教育告诉您','2','烟台光瑞职业培训学校','360','20','其他技能培训','1880','随到随学','0','','16','266','山东省/烟台市','成人','','3个月','0','0','烟台开发区福山芝罘区莱山区莱阳海阳莱州蓬莱龙口\r\n烟台考行车工汽车维修工中西式烹调师中西式面点师制冷工铣工、磨工、镗工、组合机床操作工、焊工、电焊工、钳工、装配钳工、机修钳工、工具钳工、铸造工、冷作钣金工、汽车修理（维修）工、摩托车修理工、挖掘机、叉车司机、塔式起重机、装载机驾驶员、汽车驾驶员。\r\n烟台光瑞职业培训学校,正规,专业,人社局备案，有正规办学资质有正规办学资质办学资质，是人社局批准注册的融信息技术培训、职业认证培训和企业内训为一体的民办教育机构。（办学许可证号：劳社民3706124000028号。光瑞培训学校提醒广大学员，培训考证一定查验学校办学资质，以免上当受骗，损失钱财）。培训考证100%通过，下证快！\r\n\r\n光瑞教育帮您实现愿望。烟台光瑞教育-技能培训中心面向烟台地区开展：特种设备作业人员（叉车，锅炉，电梯，起重司机）培训考证申报及钳工，装配钳工，机修钳工，电工，维修电工，焊工等级证（中级 高级 技师）职业资格证快速考证工作，保证通过，全国范围内皆可使用！\r\n\r\n一、质监局特种设备人员操作证，工种一般是：\r\n叉车司机，压力容器，锅炉司炉，电梯司机，起重机械司机，升降机司机等。\r\n\r\n二、职业资格证书是表明劳动者具有从事某一职业所必备的学识和技能的证明。\r\n职业资格证书是：\r\n1.劳动者求职、任职、开业的资格凭证；\r\n2.用人单位招聘、录用劳动者的主要依据；\r\n3.境外就业、对外劳务合作人员技能水平公证的有效证件；\r\n4.技能水平的凭证；\r\n5.与工资福利待遇挂钩。\r\n\r\n可申请鉴定工种（部分普通工种类）\r\n\r\n电工、维修电工、汽车维修电工、电子仪器仪表装调工、家用电器产品维修工、家用电子维修、数控铣工、铣工、磨工、镗工、组合机床操作工、焊工、电焊工、钳工、装配钳工、机修钳工、工具钳工、铸造工、冷作钣金工、汽车修理（维修）工、摩托车修理工、挖掘机、叉车司机、塔式起重机、装载机驾驶员、汽车驾驶员、起重机装配机操作工等。\r\n\r\n三、安监局特种作业操作证申报工种：电工、焊工、焊接与切割作业特殊工种上岗证IC卡，全国范围内皆可使用！\r\n\r\n更多内容请进入光瑞教育官网查看：www.ytpxedu.com\r\n\r\n联系地址：烟台开发区泰山路87-5 华明大厦2层（中信银行旁，德胜路口南300米）\r\n公交线路：乘23、205、206路到开发区中信银行站下车对面即是','0','1441595650','1444187650','1441595650','0','0','','2','1','1','汽车维修工证好考吗？报名需要什么资料？烟台福山光瑞教育告诉您 烟台光瑞职业培训学校  汽车00 汽车维修 汽车维修工 维修00 维修工0 报名00 需要00 什么00 资料00 烟台00 教育00 告诉00 职业00 培训00 学校00 其他00 技能00 山东00 山东省0 开发00 开发区0 莱山00 山区00 莱阳00 海阳00 莱州00 蓬莱00 龙口00 行车00 行车工0 车工00 中西00 西式00 烹调00 烹调师0 面点00 面点师0 制冷00 制冷工0 铣工00 磨工00 镗工00 组合00 组合机0 机床00 机床操作工 操作00 操作工0 作工00 焊工00 电焊00 电焊工0 钳工00 装配00 装配钳工 机修00 机修钳工 工具00 铸造00 钣金00 钣金工0 金工00 修理00 摩托00 摩托车0 托车00 修理工0 理工00 挖掘00 挖掘机0 叉车00 叉车司机 司机00 塔式00 起重00 起重机0 重机00 装载00 装载机0 驾驶00 驾驶员0 车驾00 正规00 专业00 备案00 办学00 资质00 批准00 注册00 信息00 技术00 认证00 企业00 业内00 一体00 民办00 机构00 提醒00 广大00 大学00 学员00 考证00 一定00 查验00 校办00 以免00 上当00 受骗00 损失00 钱财00 通过00 实现00 愿望00 中心00 面向00 台地00 地区00 开展00 特种00 设备00 作业00 业人员0 人员00 锅炉00 电梯00 申报00 电工00 维修电工 等级00 等级证0