INSERT INTO `qs_course` VALUES ('2406','0','72455','电工证怎么复审？复审需要什么资料？来烟台福山开发区光瑞教育','2','烟台光瑞职业培训学校','360','20','其他技能培训','1880','随到随学','0','','16','266','山东省/烟台市','成人','','3个月','0','0','烟台地区电工证怎么审？审证要花多少钱？审电工证要多长时间？烟台光瑞教育帮助您。我们通常说的电工证复审是电工操作证复审，一般老证每两年复审一次，6年有效期，到期以旧换新，换成新证。从2012年以后考的都是拿的新证，新证一般是每三年审一次，也是6年换一次证件。\r\n\r\n电工证复审应当在期满前60日内，由申请人或者申请人的用人单位向原发证机关或者从业所在地考核发证机关提出申请复审或者延期复审， 没有定期进行电工证复审人员，电工证自动失效，如要补审，需要进行复效后，方可补审，手续比较麻烦些。\r\n更多内容请到光瑞教育官方网站查阅，光瑞官网：http://www.ytpxedu.com\r\n\r\n\r\n联系地址：烟台开发区泰山路87-5 华明大厦2层（中信银行旁，德胜路口南300米）\r\n公交线路：乘23、205、206路到开发区中信银行站下车对面即是','0','1441595749','1444187749','1441595749','0','0','','2','1','1','电工证怎么复审？复审需要什么资料？来烟台福山开发区光瑞教育 烟台光瑞职业培训学校  电工00 怎么00 复审00 需要00 什么00 资料00 烟台00 开发00 开发区0 教育00 职业00 培训00 学校00 其他00 技能00 山东00 山东省0 台地00 地区00 多少00 多长00 时间00 帮助00 我们00 通常00 操作00 作证00 一般00 一次00 有效00 有效期0 到期00 换成00 年审00 证件00 申请00 申请人0 或者00 用人00 单位00 原发00 发证00 机关00 从业00 所在00 所在地0 考核00 核发00 提出00 延期00 没有00 定期00 进行00 人员00 自动00 失效00 方可00 手续00 比较00 麻烦00 更多00 内容00 官方00 网站00 查阅00 联系00 地址00 泰山00 山路00 华明00 大厦00 中信00 银行00 公交00 公交线0 线路00','电工证怎么复审？复审需要什么资料？来烟台福山开发区光瑞教育,烟台光瑞职业培训学校,,','','0.000000','0.000000','1','1','0');
