INSERT INTO `qs_course` VALUES ('2408','0','72455','烟台福山哪里可以考厨师证来烟台福山芝罘光瑞教育最值得信赖','2','烟台光瑞职业培训学校','360','20','其他技能培训','1880','随到随学','0','','16','266','山东省/烟台市','成人','','3个月','0','0','烟台开发区福山芝罘区莱山区莱阳海阳莱州蓬莱龙口\r\n烟台哪里能考厨师证考初级厨师证中级厨师证高级厨师证厨师技师证还是光瑞教育值得信赖。\r\n\r\n厨师证现更改为中式烹调师，是我国的一个职业资格证书。共分五个等级。（厨师证已于2011年4月取消，工种名称现更改为中式烹调师。如有疑问可登陆国家职业资格工作网查询工种。）\r\n\r\n职业资格证书由中华人民共和国劳动和社会保障部统一印制，劳动保障部门或国务院有关部门按规定办理和核发。职业资格证书是劳动者求职、任职、创业的资格凭证，是用人单位招聘、录用劳动者的主要依据，也是境外就业、对外劳务合作人员办理技能水平公证的有效证件。\r\n\r\n厨师证按等级划分，共分五个等级:初级（国家职业资格五级），中级（国家职业资格四级），高级（国家职业资格三级），技师（国家职业资格二级），高级技师（国家职业资格一级），不同年龄段可考取不同的等级。\r\n\r\na\r\n联系地址：烟台开发区泰山路87-5 华明大厦2层（中信银行旁，德胜路口南300米）\r\n公交线路：乘23、205、206路到开发区中信银行站下车对面即是','0','1441595850','1444187850','1441595850','0','0','','2','1','1','烟台福山哪里可以考厨师证来烟台福山芝罘光瑞教育最值得信赖 烟台光瑞职业培训学校  烟台00 哪里00 可以00 厨师00 教育00 值得00 信赖00 职业00 培训00 学校00 其他00 技能00 山东00 山东省0 开发00 开发区0 莱山00 山区00 莱阳00 海阳00 莱州00 蓬莱00 龙口00 里能00 初级00 中级00 高级00 技师00 还是00 更改00 改为00 中式00 烹调00 烹调师0 我国00 一个00 资格00 资格证0 证书00 等级00 工种00 名称00 疑问00 登陆00 国家00 工作00 查询00 中华00 华人00 人民00 共和00 劳动00 社会00 保障00 统一00 印制00 部门00 国务00 国务院0 有关00 规定00 办理00 核发00 劳动者0 求职00 任职00 创业00 凭证00 用人00 单位00 招聘00 录用00 主要00 依据00 境外00 就业00 对外00 劳务00 合作00 作人00 人员00 水平00 公证00 有效00 证件00 划分00 五级00 四级00 三级00 二级00 一级00 不同00 同年00 年龄00 年龄段0 考取00 联系00 地址00 泰山00 山路00 华明00 大厦00 中信00 银行00 公交00 公交线0 线路00','烟台福山哪里可以考厨师证来烟台福山芝罘光瑞教育最值得信赖,烟台光瑞职业培训学校,,','','0.000000','0.000000','1','1','0');
INSERT INTO `qs_course` VALUES ('2409','0','72455','想找个库管员的工作不会电脑操作怎么办来烟台光瑞学习办公自动化','2','烟台光瑞职业培训学校','360','20','其他技能培训','1880','随到随学','0','','16','266','山东省/烟台市','成人','','3个月','0','0','烟台开发区福山芝罘区莱山区莱阳海阳莱州蓬莱龙口 \r\n烟台开发区专业办公软件培训学校电脑基础办公自动化班，烟台光瑞职业培训学校办公自动化培训班圆您高级文秘梦。\r\n\r\n办公自动化（Office Automation,简称OA）是将现代化办公和计算机网络功能结合起来的一种新型的办公方式。办公自动化没有统一的定义，凡是在传统的办公室中采用各种新技术、新机器、新设备从事办公业务，都属于办公自动化的领域。\r\n\r\n烟台光瑞教育培训学校办公自动化培训班通过教授Office办公自动化软件，学习Word、Excel及Powerpoint的各种功能让您轻松做办公室里的成功白领。\r\n\r\n通过对办公自动化软件的学习，您可以大幅度提高自己的工作能力和业务水平，提升自己的水准让加薪升职不再遥不可及。\r\n\r\n更多内容请到光瑞教育官方网站查阅，光瑞官网：http://www.ytpxedu.com\r\n\r\n\r\n联系地址：烟台开发区泰山路87-5 华明大厦2层（中信银行旁，德胜路口南300米）\r\n公交线路：乘23、205、206路到开发区中信银行站下车对面即是','0','1441595892','1444187892','1441595892','0','0','','2','1','1','想找个库管员的工作不会电脑操作怎么办来烟台光瑞学习办公自动化 烟台光瑞职业培训学校  库管00 库管员0 管员00 工作00 不会00 会电00 电脑00 操作00 怎么00 怎么办0 烟台00 学习00 办公00 自动00 自动化0 职业00 培训00 学校00 其他00 技能00 山东00 山东省0 开发00 开发区0 莱山00 山区00 莱阳00 海阳00 莱州00 蓬莱00 龙口00 专业00 软件00 基础00 校办00 培训班0 高级00 高级文秘 文秘00 简称00 现代00 现代化0 计算00 计算机0 网络00 功能00 结合00 起来00 新型00 方式00 没有00 统一00 定义00 凡是00 传统00 办公室0 采用00 各种00 新技00 新技术0 技术00 新机00 机器00 新设备0 设备00 从事00 业务00 属于00 领域00 教育00 通过00 教授00 轻松00 成功00 白领00 可以00 大幅00 大幅度0 幅度00 提高00 自己00 能力00 水平00 提升00 水准00 升职00 不再00 不可00 更多00 内容00 官方00 网站00 查阅00 联系00 地址00 泰山00 山路00 华明00 大厦00 中信00 银行00 公交00 公交线0 线路00','想找个库管员的工作不会电脑操作怎么办来烟台光瑞学习办公自动化,烟台光瑞职业培训学校,,','','0.000000','0.000000','1','1','0');
INSERT INTO `qs_course` VALUES ('2410','0','72455','平面设计哪里教的好包教包会来烟台开发区福山芝罘光瑞教育','2','烟台光瑞职业培训学校','360','20','其他技能培训','1880','随到随学','0','','16','266','山东省/烟台市','成人','','3个月','0','0','烟台开发区福山芝罘区莱山区莱阳海阳莱州蓬莱龙口 \r\n烟台开发区福山区光瑞教育专业平面设计班火热招生中。烟台光瑞教育培训学校平面设计培训班引领您走入平面设计的神奇领域。\r\n平面设计的定义泛指具有艺术性和专业性，以“视觉”作为沟通和表现的方式。透过多种方式来创造和结合符号、图片和文字，借此作出用来传达想法或讯息的视觉表现。平面设计师可能会利用字体排印、视觉艺术、版面（page layout）等方面的专业技巧，来达成创作计划的目的。平面设计通常可指制作（设计）时的过程，以及最后完成的作品。\r\n\r\n专业测评	Photoshop的专长在于图像处理，而不是图形创作。图像处理是对已有的位图图像进行编辑加工处理以及运用一些特殊效果，其重点在于对图像的处理加工；图形创作软件是按照自己的构思创意，使用矢量图形来设计图形。','0','1441595948','1444187948','1441595948','0','0','','2','1','1','平面设计哪里教的好包教包会来烟台开发区福山芝罘光瑞教育 烟台光瑞职业培训学校  平面00 平面设计 设计00 哪里00 烟台00 开发00 开发区0 教育00 职业00 培训00 学校00 其他00 技能00 山东00 山东省0 莱山00 山区00 莱阳00 海阳00 莱州00 蓬莱00 龙口00 专业00 火热00 招生00 培训班0 引领00 走入00 神奇00 领域00 定义00 泛指00 具有00 艺术00 艺术性0 专业性0 视觉00 作为00 沟通00 表现00 方式00 透过00 过多00 多种00 创造00 结合00 符号00 图片00 和文00 文字00 作出00 用来00 传达00 想法00 讯息00 平面设计师 设计师0 可能00 利用00 用字00 字体00 版面00 方面00 面的00 技巧00 达成00 创作00 计划00 目的00 过程00 以及00 最后00 完成00 作品00 不是00 图形00 图像00 处理00 已有00 有的00 位图00 进行00 编辑00 加工00 运用00 一些00 特殊00 效果00 重点00 在于00 软件00 按照00 自己00 构思00 创意00 使用00 矢量00 矢量图0 设计图0','平面设计哪里教的好包教包会来烟台开发区福山芝罘光瑞教育,烟台光瑞职业培训学校,,','','0.000000','0.000000','1','1','0');
INSERT INTO `qs_course` VALUES ('2411','0','72455','烟台开发区德胜附近哪里有教CAD制图设计的到烟台开发区光瑞来','2','烟台光瑞职业培训学校','360','20','其他技能培训','1880','随到随学','0','','16','265','山东省/东营市','成人','','3个月','0','0','烟台开发区福山芝罘区莱山区莱阳海阳莱州蓬莱龙口 \r\n烟台开发区学CAD制图机械制图机械图设计工程制图工程图设计首选正规专业的光瑞教育。烟台开发区光瑞教育欢迎您――烟台开发区福山区芝罘区莱山区学专业CAD培训班，CAD一对一班，烟台光瑞教育培训学校CAD培训班圆您设计梦。\r\n计算机辅助设计(CAD-Computer Aided Design)指利用计算机及其图形设备帮助设计人员进行设计工作。目前比较流行的二维软件是AutoCAD，比较实用的三维软件UG、Pro/Engineer、Unigraphics NX等集二维、三维、CAD/CAM于一体的众多国外软件，但浩辰、中望、CAXA等比较符合中国人思维的国产CAD/CAM也在逐渐崛起，占据了一定的份额，浩辰、中望更是走向了国际。\r\nAutoCAD的基本功能：平面绘图、绘图辅助工具、编辑图形、标注尺寸、书写文字、图层管理功能、三维绘图、网络功能。\r\n用途简介：CAD首先它是一个可视化的绘图软件，许多命令和操作可以通过菜单选项和工具按钮等多种方式实现。而且具有丰富的绘图和绘图辅助功能，如实体绘制、关键点编辑、对象捕捉、标注、鸟瞰显示控制等，它的工具栏、菜单设计、对话框、图形打开预览、信息交换、文本编辑、图像处理和图形的输出预览为用户的绘图带来很大方便。其次它不仅在二维绘图处理更加成熟，三维功能也更加完善，可方便地进行建模和渲染。\r\n通过对CAD软件的学习，您可以大幅度提高自己的工作能力和业务水平，提升自己的水准让加薪升职不再遥不可及。\r\n\r\n联系地址：烟台开发区泰山路87-5 华明大厦2层（中信银行旁，德胜路口南300米）\r\n公交线路：乘23、205、206路到开发区中信银行站下车对面即是','0','1441596209','1444188209','1441596209','0','0','','2','1','1','烟台开发区德胜附近哪里有教CAD制图设计的到烟台开发区光瑞来 烟台光瑞职业培训学校  烟台00 开发00 开发区0 附近00 哪里00 CAD制图 AD000 制图00 设计00 职业00 培训00 学校00 其他00 技能00 山东00 山东省0 东营00 莱山00 山区00 莱阳00 海阳00 莱州00 蓬莱00 龙口00 机械00 机械制图 设计工0 工程00 首选00 正规00 专业00 教育00 欢迎00 培训班0 一对一0 计算00 计算机0 辅助00 利用00 及其00 图形00 设备00 帮助00 设计人0 设计人员 人员00 进行00 工作00 目前00 比较00 流行00 二维00 软件00 实用00 三维00 于一体0 一体00 众多00 国外00 等比00 符合00 中国00 国人00 思维00 国产00 逐渐00 崛起00 占据00 一定00 份额00 更是00 走向00 国际00 基本00 基本功0 功能00 平面00 绘图00 辅助工0 工具00 编辑00 标注00 尺寸00 书写00 文字00 管理00 网络00 用途00 简介00 首先00 一个00 可视00 可视化0 许多00 命令00 操作00 可以00 通过00 菜单00 选项00 按钮00 多种00 方式00 实现00 而且00 具有00 丰富00 如实00 实体00 绘制00 关键00 关键点0 对象00 捕捉00 鸟瞰00 显示00 控制00 对话00 打开00 预览00 信息00 交换00 文本00 图像00 处理00 输出00 用户00 带来00 很大00 大方00 方便00 其次00 不仅00 更加00 加成00 成熟00 完善00 建模00 渲染00 学习00 大幅00 大幅度0 幅度00 提高00 自己00 能力00 业务00 水平00 提升00 水准00 升职00 不再00 不可00 联系00 地址00 泰山00 山路00 华明00 大厦00 中信00 银行00 公交00 公交线0 线路00','烟台开发区德胜附近哪里有教CAD制图设计的到烟台开发区光瑞来,烟台光瑞职业培训学校,,','','0.000000','0.000000','1','1','0');
INSERT INTO `qs_course` VALUES ('2412','0','73324','南通学化妆美甲首选伊彩风尚化妆美甲学校','2','伊彩风尚形象教育职业学校','423','3','美容','1880','随到随学','0','','11','205','江苏省/南通市','零基础','','一至三个月','1600','1400','学化妆美甲到专业化妆美甲学校，技能、学历、工作一步到位~~你还等什么呢？\r\n       伊彩风尚引领时尚，此课程针对希望\r\n从事美甲工作、经营美甲店，美甲会所，及\r\n学校科目：\r\n为各类型美甲店培养高级美甲人才，无年龄限制，用最短的时间教授现在美甲行业最实用的技术和最时尚的款式，\r\n结合国际3D雕艺技术与光疗延长甲为主体设计，所设计的美甲款式均为伊彩原创，简单易学，课程以实际操作为主使学员在短时间内就能较全面的掌握高级美甲技术，毕业后可从事高级美甲师工作或自行创业。','1441814400','1441596269','1444188269','1441596269','0','0','','1','1','5','南通学化妆美甲首选伊彩风尚化妆美甲学校 伊彩风尚形象教育职业学校  南通00 化妆00 美甲00 首选00 风尚00 学校00 形象00 教育00 职业00 美容00 江苏00 江苏省0 专业00 专业化0 技能00 学历00 工作00 到位00 什么00 引领00 时尚00 课程00 针对00 希望00 从事00 经营00 会所00 各类00 类型00 培养00 培养高0 高级00 人才00 年龄00 限制00 时间00 教授00 现在00 行业00 实用00 技术00 款式00 结合00 国际00 延长00 为主00 主体00 设计00 原创00 简单00 易学00 实际00 操作00 作为00 学员00 短时00 全面00 面的00 掌握00 毕业00 美甲师0 师工00 自行00 创业00','南通学化妆美甲首选伊彩风尚化妆美甲学校,伊彩风尚形象教育职业学校,,','','0.000000','0.000000','1','1','0');
INSERT INTO `qs_course` VALUES ('2415','0','73326','科技路西口办公PSCAD制图3DMAX培训首选','2','智能教育','424','17','工业设计','1880','随到随学','0','','27','435','陕西省/西安市','零基础学起','','30','0','0','详细地址： 高新区- 科技路- 科技路西口华润万家&#8203;&#8204;&#8204;楼上5楼504室\r\n类别：办公自动化 |电脑入门/打字 Office 上网 \r\n形式： 脱产班 周末班 寒暑假班 工作日班 \r\nQQ/MSN：\r\n专业办公、PS、CAD制图、3DMAX培训―首选智能培训班有关课程授课内容详情如下：\r\n随到随学，常年开班，确保学会\r\n一、办公自动化班 学习微机入门原理，windowsxp/win7的使用，互联网的基础知识，包括电子邮件的收发，网络资源的下载，桌面管理以及文件管理及系统的管理，办公软件的管理，包括。word（编辑文件、美化文档和技巧、表格的制作与技巧、图形图片等操作，excel制作表格、编辑和管理工作表、公式和函数的综合应用、图形图表等。 \r\n二、平面设计班 学习photoshop，和coreldraw，包括图像处理，图层的应用、色彩色调的调整、图像特效及数码相片的处理，应用于装饰、婚纱设计等领域。 \r\n三、室内设计/机械制图设班 学习autoCAD，3DMAX，绘图基础知识，基本工具的用法、坐标轴编辑和布置图形、体及曲面建模、标准平面图形绘制、尺寸标注、输入输出、打印出图等，建筑居室平面设计，制作场景及各类家具，基础立体建模设计等\r\n\r\n以上是培训机构西安智能技术培训学校发布的专业办公、PS、CAD制图、3DMAX培训―首选智能培训班信息','0','1441606044','1473142044','1441606044','0','0','','2','1','1','科技路西口办公PSCAD制图3DMAX培训首选 智能教育  科技00 西口00 办公00 CAD制图 AD000 制图00 培训00 首选00 智能00 教育00 工业00 工业设计 设计00 陕西00 陕西省0 西安00 西安市0 详细00 地址00 高新00 高新区0 新区00 华润00 类别00 自动00 自动化0 电脑00 入门00 打字00 上网00 形式00 脱产00 脱产班0 周末00 末班00 寒暑00 寒暑假0 暑假00 工作00 工作日0 专业00 培训班0 有关00 课程00 授课00 内容00 详情00 如下00 常年00 开班00 确保00 学会00 学习00 微机00 原理00 使用00 互联00 互联网0 联网00 基础00 知识00 包括00 电子00 邮件00 收发00 网络00 资源00 下载00 桌面00 管理00 以及00 文件00 系统00 软件00 编辑00 美化00 文档00 技巧00 表格00 制作00 图形00 图片00 操作00 理工00 公式00 函数00 综合00 应用00 图表00 平面00 平面设计 图像00 处理00 色彩00 彩色00 色调00 调整00 特效00 数码00 相片00 用于00 装饰00 婚纱00 领域00 室内00 室内设计 内设00 机械00 机械制图 绘图00 基本00 工具00 用法00 坐标00 布置00 曲面00 建模00 标准00 平面图0 绘制00 尺寸00 标注00 输入00 输出00 打印00 出图00 建筑00 居室00 场景00 各类00 类家00 家具00 立体00 以上00 机构00 技术00 学校00 发布00 信息00','科技路西口办公PSCAD制图3DMAX培训首选,智能教育,,','','108.879424','34.243727','1','1','0');
INSERT INTO `qs_course` VALUES ('2416','0','71589','扬州计算机Office办公文员培训学电脑基础知识(扬州)','2','扬州此方教育科技有限公司','226','11','IT培训','1880','随到随学','0','','11','209','江苏省/扬州市','任何人均可','','18','0','0','扬州电脑计算机培训学校 扬州电脑办公文员培训，扬州商务办公实战培训，扬州计算机基础学习班，扬州办公文秘考证培训，扬州计算机等级考试辅导班，扬州电脑设计培训学校，零基础学电脑办公软件包会。\r\n \r\n培训对象：没有电脑基础，，对电脑感兴趣适或有志于从事计算机办公文秘工作的人员。 \r\n\r\n扬州此方教育包含了机械设计、平面设计和办公自动化等计算机课程。涉及solidworks、CAD、photoshop、CorelDRAW、Illustrator、word、excel、PPT等专业软件的学习，欢迎广大学员前来咨询！\r\n \r\n培训对象：个人及企业培训（可向企业客户提供上门培训，培训内容可根据需求定制）\r\n \r\n地址：扬州市邗江区老汽车西站东，润扬广场3号商务楼3008室（一楼乘电梯上三楼）\r\n微信：lifan8526\r\n咨询电话：15062790805\r\nQQ：2018151397','0','1441606985','1527920585','1441606985','0','0','','1','1','2','扬州计算机Office办公文员培训学电脑基础知识(扬州) 扬州此方教育科技有限公司  扬州00 计算00 计算机0 办公00 办公文员 公文00 文员00 培训00 电脑00 基础00 知识00 教育00 教育科0 科技00 有限00 公司00 IT000 江苏00 江苏省0 州市00 学校00 商务00 实战00 学习00 学习班0 办公文秘 文秘00 考证00 等级00 级考00 考试00 辅导00 辅导班0 设计00 零基00 软件00 软件包0 对象00 没有00 兴趣00 有志00 有志于0 从事00 工作00 人员00 包含00 机械00 机械设计 平面00 平面设计 自动00 自动化0 课程00 涉及00 AD000 专业00 欢迎00 广大00 大学00 学员00 前来00 咨询00 个人00 企业00 客户00 提供00 上门00 内容00 根据00 需求00 定制00 地址00 邗江00 汽车00 西站00 电梯00 上三00','扬州计算机Office办公文员培训学电脑基础知识(扬州),扬州此方教育科技有限公司,,','','119.409029','32.375190','1','1','0');
INSERT INTO `qs_course` VALUES ('2417','5','71531','上海室内设计培训哪家好 学室内拥有良好发展前景','2','上海非凡学院','221','11','IT培训','1880','随到随学','0','','2','62','上海市/闵行区','上海室内设计培训','','1','0','0','目前室内设计在设计行业占有很大的主导位置，学了室内设计可以从事很多行业，比如室内装潢、家装、CAD制图、效果图渲染等各种设计工作以及各种空间设计工作，有良好的发展前景。\r\n\r\n联系人：纪老师  联系电话：021-62120703 手机：13764877826  QQ：2273389306 微信号：feifan_mr_ji\r\n\r\n课程介绍：\r\n第一阶段\r\n1、美术基础：通过此阶段教学提高学生的美术观察能力。了解光和影的概念，及构图、比例、虚实、明暗等关系，提高学员的艺术素养和审美能力。\r\n2、手绘技法：掌握透视原理、手绘效果图表现技法（铅笔白描、彩铅技法、马克笔技法、室内表现等）；熟练手绘建筑平面图，立面图，节点大样图等。\r\n3、电脑效果图基础：掌握电脑平面图、剖面图、立面图等绘制；掌握建模、灯光、材质、效果图设计、展示设计等。\r\n\r\n第二阶段\r\n1、室内设计原理：了解室内设计最新发展趋势、结合实例学习室内设计的基本方法、人体工程学和陈设等。掌握室内设计的有关知识，如室内采光、照明、色彩、家具、陈设、绿化、室内环境心理学等。\r\n2、室内软装饰设计：掌握墙纸，涂料与家具色彩搭配，室内家具摆设，室内环境布置，绿化等配饰等。\r\n\r\n第三阶段\r\n1、电脑效果图高级:高级建模、高级材质使用、高级材质使用、高级灯光应用、室内方案设计、室外综合效果图制作等。\r\n2、电脑效果图实训：全面运用以上软件制作照片级效果图，通过练习工作案例，全面提高效果图制作水平。\r\n3、室内工程方案设计-材料与预算：重点掌握学习装饰工程施工预算基本理论知识，掌握工程定额的概念、用途和费用构成规律、依据，能够熟练计算工程量、工程总造价。掌握成本控制的方法，学习装饰工程预算方法。\r\n4、室内工程方案设计-施工工艺：通过此阶段教学让学员了解建筑装饰工程的施工方法和工艺流程等，学习施工过程中质量管理方法。','0','1441611299','1527924899','1441611299','0','0','','1','1','1','上海室内设计培训哪家好 学室内拥有良好发展前景 上海非凡学院  上海00 室内00 室内设计 内设00 设计00 培训00 哪家00 拥有00 良好00 发展00 前景00 非凡00 学院00 IT000 上海市0 目前00 行业00 占有00 很大00 主导00 位置00 可以00 从事00 多行业0 比如00 装潢00 家装00 CAD制图 AD000 制图00 效果00 效果图0 渲染00 各种00 设计工0 工作00 以及00 及各种0 空间00 空间设计 联系00 联系人0 老师00 手机00 信号00 课程00 介绍00 第一00 阶段00 美术00 了解00 概念00 构图00 比例00 虚实00 关系00 提高00 高学00 学员00 艺术00 素养00 审美00 能力00 手绘00 技法00 掌握00 透视00 原理00 图表00 表现00 铅笔00 白描00 马克00 熟练00 建筑00 平面00 平面图0 立面00 节点00 大样00 电脑00 剖面00 剖面图0 绘制00 建模00 灯光00 材质00 效果图设计 展示00 展示设计 第二00 二阶00 最新00 趋势00 结合00 实例00 学习00 基本00 本方00 方法00 人体00 工程00 工程学0 陈设00 有关00 知识00 采光00 照明00 色彩00 家具00 绿化00 内环00 环境00 心理00 心理学0 理学00 装饰00 墙纸00 涂料00 搭配00 摆设00 布置00 配饰00 第三00 高级00 使用00 应用00 方案00 室外00 综合00 效果图制作 图制00 制作00 全面00 运用00 用以00 以上00 软件00 照片00 通过00 练习00 作案00 案例00 高效00 水平00 材料00 预算00 重点00 饰工程0 施工00 理论00 定额00 用途00 费用00 构成00 成规00 规律00 依据00 能够00 计算00 工程量0 造价00 成本00 控制00 工程预算 工艺00 教学00 施工方0 流程00 过程00 质量00 质量管理 管理00 管理方0','上海室内设计培训哪家好 学室内拥有良好