INSERT INTO `qs_course` VALUES ('2418','5','71531','上海景观设计培训哪家好 景观设计师好就业拿高薪','2','上海非凡学院','221','11','IT培训','1880','随到随学','0','','2','63','上海市/宝山区','上海景观设计培训','','1','0','0','想成为一位景观设计水平突出、设计理念充满正能量的设计师请到上海非凡进修学院。最深厚的教学底蕴、最优秀的教师、最实用的课程、电脑实操演练、老师一对一耐心指导、包教包会，就业不是问题，明天将是奇迹。\r\n\r\n联系人：纪老师  联系电话：021-62120703 手机：13764877826  QQ：2273389306 微信号：feifan_mr_ji\r\n\r\n培训内容：\r\n1.美术设计初级和中级、速写。\r\n2.电脑效果图表现：CAD制图、Photoshop、3dsmax效果图、3dsmax高级建模、PS后期处理、CAD高级制图、VRAY渲染。\r\n3.手绘施工图、手绘效果图\r\n4.景观设计理论：设计概论、景观设计原理、人体工程学、景观分类原理。\r\n5.专项训练：景观手绘训练（建筑景观速写、手绘景观效果图实战）、景观施工与效果图训练（景观3D效果图及后期处理、Sketchup草绘大师）。\r\n6.景观方案设计：材料与施工管理、报价与预算、屋顶花园设计、庭院小景观设计、小区景观规划设计、城市公园景观规划设计。\r\n7.挑战注册设计师考前辅导（强化训练手绘效果图和彩色平面图，进行居住区域或景观园林设计,平面图，施工图，考点要求、理论讲解、方案指导、制图标准、模拟考试）\r\n8.职业素养与就业指导（毕业作品整理、行业规范与合同、职场与行业分析、企业观模与规划、职场岗位实战模拟、创业指导、实习与预工作）\r\n\r\n培训目标：结业后可达到灵活运用cad,ps,3d结合景观设计相关的方案理念进行景观设计和制作，达到高级至实战的效果。培训完以后相当于有1年左右的工作经验\r\n认证证书：中国注册《景观设计师》证书、国际注册《景观设计师》证书\r\n学习周期：全日制6-7个月；业余制12个月左右\r\n\r\n我校开班分为：全日制班和业余制班 \r\n白天班（9:00-12:00 13:30-16:30） \r\n周末班（9:00-12:00 13:30-16:30） \r\n晚上班（18：30-21：30）\r\n\r\n学院特色（八大优势）: \r\n品牌优势：正规办学 交大底蕴 专业优势：市场导向 专业性强 \r\n技术优势：行业领先 专注技能 师资优势：筛选严格 实战为先 \r\n教学优势：设施先进 模式新颖 服务优势：360度服务 互动评分 \r\n考证优势：体系完备 权威认证 就业优势：四重保障 全面指导\r\n\r\n免费试听：（发送姓名+课程到老师手机，即可获得试听信息）','0','1441611338','1527924938','1441611338','0','0','','1','1','2','上海景观设计培训哪家好 景观设计师好就业拿高薪 上海非凡学院  上海00 景观00 景观设计 设计00 培训00 哪家00 景观设计师 设计师0 就业00 高薪00 非凡00 学院00 IT000 上海市0 宝山00 山区00 成为00 水平00 突出00 理念00 充满00 能量00 进修00 修学00 最深00 深厚00 教学00 底蕴00 优秀00 教师00 实用00 课程00 电脑00 演练00 老师00 一对一0 耐心00 指导00 不是00 问题00 明天00 天将00 奇迹00 联系00 联系人0 手机00 信号00 内容00 美术00 美术设计 初级00 中级00 速写00 效果00 效果图0 图表00 表现00 CAD制图 AD000 制图00 高级00 建模00 后期00 处理00 渲染00 手绘00 施工00 施工图0 理论00 概论00 原理00 人体00 工程00 工程学0 分类00 专项00 训练00 建筑00 实战00 大师00 方案00 材料00 施工管理 管理00 报价00 预算00 屋顶00 花园00 庭院00 小区00 规划00 规划设计 城市00 公园00 挑战00 注册00 考前00 辅导00 强化00 彩色00 平面00 平面图0 进行00 居住00 居住区0 住区00 区域00 园林00 考点00 要求00 讲解00 图标00 标准00 模拟00 考试00 职业00 素养00 毕业00 作品00 整理00 行业00 规范00 合同00 职场00 分析00 企业00 岗位00 创业00 实习00 工作0