INSERT INTO `qs_course` VALUES ('2419','5','71531','上海服装设计培训哪家好 学服装设计的首选学校','2','上海非凡学院','221','11','IT培训','1880','随到随学','0','','2','59','上海市/闸北区','上海服装设计培训','','1','0','0','本校每个课程均是资深设计、立体裁剪、制版裁剪、工艺制作全能导师授课，做到真正的融会贯通拿捏准确。多年实战工作经验和教学经验融合一体，手把手教。深入浅出，无任何保留把全部的精髓传授给你。\r\n\r\n联系人：纪老师  联系电话：021-62120703 手机：13764877826  QQ：2273389306 微信号：feifan_mr_ji\r\n\r\n课程介绍：\r\n第一阶段： \r\n1.美术基础：素描造型的基本因素及手段，变化规律及应用，画几何形体的意义，研究直线与曲线的规律，静物写生，速写等。 \r\n2.时装效果图高级技法：认识服装的各个款式，如：休闲的，职业的，淑女的，运动的等等 \r\n3.数码时装设计：掌握时装在电脑上的绘制技巧，个人时装手册制作。历年来时间主题的不同内容绘制。\r\n4.探求面料、用色和印花，追求更高技术层面。主要学习软件有：Illustrator、CorelDraw 、Photoshop、Painter。\r\n\r\n第二阶段： \r\n1.立体裁剪:衣身原型、人台表面、省道的转移等立体裁剪原型基础造型翻领女衬衫、男衬衫式女衬衫、紧身裙、低腰分割型连衣裙、高腰分割型连衣裙、基本西装女外套上衣、时尚派对款女外套上衣等立体裁剪基本款式实例。\r\n2.平面制版:通过测量人体采取尺寸，然后使用原形、比例等方法的操作来完成纸样设计。\r\n3.服装CAD:服装CAD在企业的作用、服装CAD界面及工具的介绍。裙类电脑制版、裤类电脑制版、上衣类电脑制版、电脑放码、电脑排料。\r\n4.服装工艺:车缝基础，袋型、领型、装拉链、裤头、开衩、工艺制作，衬衣、裙、裤的制作，面辅料的基础知识、生产工艺流程以及各种和整件西裙、全里时装、女西装、大衣、等服装制作，缝制工艺从初级到高级的完整提升。\r\n\r\n第三阶段： \r\n1.服装史论解析：通过理论与调研相结合的学习，掌握近现代世界服装发展的历史，了解服装行业的现状，服装的分类，掌握服装流行趋势收集和整理。了解服装设计师的使命。\r\n2.服装设计方法详解\r\n3.服装工艺技术: 学习立体和平面两种制版方法、研究服装的缝制和其它工艺，深入学习服装初样单的制作，从而掌握服装从构想变为实物的技能。\r\n\r\n免费试听：（发送姓名+课程到老师手机，即可获得试听信息）','0','1441611398','1527924998','1441611398','0','0','','1','1','2','上海服装设计培训哪家好 学服装设计的首选学校 上海非凡学院  上海00 服装00 服装设计 装设00 设计00 培训00 哪家00 首选00 选学00 学校00 非凡00 学院00 IT000 上海市0 闸北00 北区00 本校00 每个00 课程00 资深00 资深设计 立体00 体裁00 裁剪00 制版00 工艺00 制作00 全能00 导师00 授课00 做到00 真正00 融会00 贯通00 拿捏00 准确00 多年00 实战00 工作00 经验00 教学00 融合00 合一00 一体00 手把00 手把手0 把手00 深入00 任何00 保留00 全部00 精髓00 传授00 联系00 联系人0 老师00 手机00 信号00 介绍00 第一00 阶段00 美术00 变化00 规律00 应用00 几何00 几何形0 形体00 意义00 研究00 直线00 曲线00 静物00 写生00 速写00 时装00 效果00 效果图0 高级00 技法00 认识00 各个00 款式00 休闲00 职业00 淑女00 运动00 等等00 数码00 掌握00 电脑00 绘制00 技巧00 个人00 手册00 历年00 历年来0 年来00 来时00 时间00 主题00 不同00 内容00 探求00 面料00 印花00 追求00 高技术0 技术00 层面00 主要00 学习00 软件00 第二00 二阶00 原型00 表面00 省道00 转移00 基础00 造型00 翻领00 衬衫00 紧身00 低腰00 分割00 连衣00 连衣裙0 衣裙00 基本00 西装00 外套00 上衣00 时尚00 派对00 实例00 平面00 通过00 测量00 人体00 采取00 尺寸00 然后00 使用00 原形00 比例00 方法00 操作