INSERT INTO `qs_course` VALUES ('2420','5','71531','上海Catia培训 上海Ansys培训','2','上海非凡学院','221','11','IT培训','1880','随到随学','0','','2','65','上海市/浦东新区','上海模具设计培训','','1','0','0','上海非凡进修学院着重以培养学生技能为主，提高学员综合能力 ，以解决学生就业为目标的教学指导方针，近十年的办学历程，已培养了近万名学生走向不同 的设计工作岗位。学院在提高学员理论同时，不断加强学员的实战操作的能力。\r\n\r\n联系人：纪老师  联系电话：021-62120703 手机：13764877826  QQ：2273389306 微信号：feifan_mr_ji\r\n\r\n培训内容：\r\nSolidworks实战班：\r\n全面讲解Solidworks基础知识、曲面及零件设计、装配及智能设计、工程图、钣金及焊接 、动画制作及综合应用,培训完胜任产品设计\\\\工艺设计师等应用；\r\n认证证书：上海模协《solidworks》认证\r\n\r\nCatia模具设计全科班\r\n1.Catia标准班:基础操作，实体建模、简单曲面建模、实体运算、动态草绘，零件设计基础，线框和曲面设计；装配设计等，毕业后学员能制作机械零件等设计；\r\n2.Catia提高：曲面圆角、拔模、曲率分析、曲面和实体混合设计、钣金设计、模具设计、有限元分析，毕业后学员能从事各种机械零件、模具钣金设计等；\r\n\r\nAnsys有限元分析\r\n1.标准班:三维模型处理、网格划分、CAE求解处理流程、ANSYS常见分析类型；\r\n2.提高班：产品CAD参数化建模、产品多工况组合分析、多物理场耦合仿真、产品结构之形状优化、产品优化与鲁棒性设计。偏向受力、结构、热力、振动等方面的分析应用。\r\n认证证书：全国《Ansys》证书\r\n\r\n.......................................................\r\n教育理念：\r\n1、以解决企业人才需求为目标，培养实用人才。\r\n2、以解决学员学习目标为追求，研发培训课程。\r\n3、办学以人为本，培养人才以能力为本。\r\n4、秉承“厚基础、重技能”的教学方针。\r\n5、以“求实、创新、进取、奉献”为经营理念。\r\n6、以“责任、敬业、和谐”为工作理念。\r\n\r\n免费试听，满意在报名！（PS：我们同时提供公司内训，公司内训可定制。欢迎各企业咨询。）','0','1441611621','1527925221','1441611621','0','0','','1','1','2','上海Catia培训 上海Ansys培训 上海非凡学院  上海00 培训00 非凡00 学院00 IT000 上海市0 浦东00 新区00 进修00 修学00 着重00 以培养0 培养00 学生00 技能00 为主00 提高00 高学00 学员00 综合00 能力00 解决00 生就00 生就业0 就业00 目标00 标的00 教学00 指导00 方针00 办学00 学历00 历程00 名学00 走向00 不同00 设计00 设计工0 工作00 岗位00 理论00 同时00 不断00 加强00 实战00 操作00 联系00 联系人0 老师00 手机00 信号00 内容00 全面00 讲解00 基础00 知识00 曲面00 零件00 装配00 智能00 工程00 钣金00 焊接00 动画00 动画制作 制作00 应用00 完胜00 胜任00 产品00 产品设计 工艺00 工艺设计 工艺设计师 设计师0 认证00 证书00 模具00 模具设计 全科00 科班00 标准00 实体00 建模00 简单00 单曲00 运算00 动态00 毕业00 后学00 制作机0 机械00 圆角00 曲率00 分析00 混合00 钣金设计 有限00 有限元0 从事00 各种00 三维00 模型00 处理00 网格00 划分00 AE000 求解00 流程00 常见00 类型00 提高班0 AD000 参数00 化建00 工况00 组合00 物理00 耦合00 仿真00 结构00 形状00 优化00 偏向00 受力00 热力00 振动00 方面00 面的00 全国00 教育00 理念00 企业00 人才00 需求00 实用00 用人00 学习00 追求00 研发00 课程00 人为00 养人00 秉承00 求实00 创新00 进取00 奉献00 经营00 责任00 敬业00 和谐00 免费00 试听00 满意00 意在00 报名00 我们00 