INSERT INTO `qs_course` VALUES ('2421','11','72941','公共营养师培训来郑州宏恩职业培训学校','2','郑州宏恩职业培训学校','404','27','其他资格培训','1885','其他班','0','','17','0','河南省','公共营养师资格考试的培训对象主要是：幼儿园保健医，学校校医，医疗机构及社区卫生站的医护人员，集体饭堂','','48','0','0','学习内容： \r\n　　公共营养师学习的内容主要有：基础营养学、临床营养学、中医基础理论、中医饮食调补理论、中医营养评价、食品卫生学、特殊人群的营养、各类食品的营养价值、营养专题教育、营养计算软件的应用、营养师就业创业指导、食品的物理及简单的生化检测方法等。重点学习并掌握食物选择、食谱编制、基本烹调、营养等内容和技能。\r\n　　通过考试，成绩合格者将颁发公共营养师国家职业资格证。\r\n公共营养师职业概况\r\n\r\n公共营养师是国家劳动部颁布的第4批新职业之一。是应社会、市场的需要而产生的职业技能人才，指接受专业知识技能培训，通过国家职业资格考试认证，取得从业资格（劳部发[1994]98号文件第六条规定“劳动部负责以技能为主的职业资格鉴定和证书的核发与管理”），从事营养咨询、营养测评、营养指导、营养宣教、营养管理以及从事营养教学与科研工作、营养与食品安全知识传播的特殊职业者，是促进社会公众健康工作的专业人员。\r\n　　目前，我国的营养专业人才十分紧缺，公共营养师的就业前景非常广阔。公共营养师可以针对健康和亚健康人群做营养咨询、指导工作。公共营养师不仅可以在社区发挥重要作用，还可为企业员工、白领、高级管理人员、运动员、家庭提供教育、辅导、指导等服务。','1442332800','1441612319','1444204319','1441612319','0','0','','1','1','1','公共营养师培训来郑州宏恩职业培训学校 郑州宏恩职业培训学校  公共00 营养00 营养师0 师培00 培训00 郑州00 宏恩00 职业00 学校00 其他00 资格00 河南00 河南省0 学习00 内容00 主要00 基础00 营养学0 临床00 中医00 理论00 饮食00 评价00 食品00 卫生00 卫生学0 特殊00 人群00 各类00 价值00 专题00 教育00 计算00 软件00 应用00 就业00 创业00 指导00 物理00 简单00 生化00 检测00 方法00 重点00 掌握00 食物00 选择00 食谱00 编制00 基本00 烹调00 等内容0 技能00 通过00 考试00 成绩00 合格00 合格者0 颁发00 国家00 资格证0 师职00 概况00 劳动00 劳动部0 颁布00 之一00 社会00 市场00 需要00 产生00 能人00 人才00 接受00 专业00 知识00 认证00 取得00 从业00 文件00 条规00 规定00 负责00 为主00 鉴定00 证书00 核发00 管理00 从事00 咨询00 测评00 宣教00 以及00 教学00 科研00 工作00 安全00 传播00 职业者0 业者00 促进00 公众00 健康00 业人员0 人员00 目前00 我国00 十分00 紧缺00 前景00 非常00 广阔00 可以00 针对00 亚健康0 健康人0 指导工0 不仅00 社区00 发挥00 重要00 作用00 企业00 业员00 员工00 白领00 高级00 管理人0 管理人员 运动00 运动员0 动员00 家庭00 提供00 辅导00 等服务0 服务00','公共营养师培训来郑州宏恩职业培训学校,郑州宏恩职业培训学校,,','','0.000000','0.000000','1','2','0');
