INSERT INTO `qs_course` VALUES ('2425','11','73388','大专、本科学历报名即将截止','2','联盟教育咨询有限公司','428','32','成人教育','1885','其他班','0','','17','278','河南省/郑州市','18-50岁适龄人群','成人高等教育大专、本科学历（学信网可查）','10','500','200','国家承认学历 学信网可查 成人高考专升本/高起专/高起本 开始火热报名！ 单位评职称；公司升职加薪；提升学历是必须的！轻轻松松拿证书！不要等到急需时让它成为遗憾！ 即日起，考前培训（含培训教材+考前培训班），河南省十余所高校高校涵盖各种专业，等你来！ 给自己一个机会，让自己尝试着做更好的自己！\r\n\r\n一、招生对象：\r\n\r\n专科起点可升本科（专升本） 初中，高中，中专起点可升专科，本科（高起专，高起本）\r\n\r\n二、报考条件：\r\n\r\n1、专升本需提供本人身份证、专科毕业证（以上均为复印件）\r\n\r\n2、高起专、高起本只需提供个人身份证复印件\r\n\r\n三、报名资料：\r\n\r\n1、身份证复印件一张。\r\n\r\n2、本人最高学历的毕业证书复印件一张，按照教育部规定，报考专科起点升本科的考生，须持国民教育系\r\n\r\n四、报名时间：\r\n\r\n即日起开始报名，截止日期8月31号\r\n\r\n五、报名地址：\r\n\r\n1、郑州市中原区中原路秦岭路中原万达A座1339室\r\n\r\n六、交费流程：\r\n\r\n预交培训费――――》领取考前复习资料――――》省招办所在区采集信息――――》参加入学考试――――》公布考试分数――――》公布录取结果――――》交学费（按年交学费\r\n\r\n七、我们的优势：\r\n\r\n1、超强考前培训--联盟以专业的成人高考资讯先人一步，汇集最优秀的成人高考考培训专业教授，全面系统性提高学生水平，勾画重点，直接提升应试能力。\r\n\r\n2、录取优势--联盟成考洞悉河南省成人高考招生政策，同时与河南省内以及全国各大高校有着良好的合作关系，为考生提供专业的报考指导，务求做到有考必上，有报必录。\r\n\r\n3、贴身服务--从报考辅导班开始：上课复习成考网上预报成考指定确认点电子摄像成人高考考试出成绩录取报到入学毕业，我们全程贴身服务，为您的求学之路保驾护航。\r\n\r\n4、无忧承诺--联盟成考郑重承诺：学生报读我们推荐的院校而不被录取的，全额退费\r\n\r\n5、服务完善--由专职每班班主任，负责专项服务，随时为考生提供免费的专业答疑，及时提供学生所需的成人高考资讯。 （（另外本公司还提供：在职研究生，教师资格证，一级建造师，建筑八大员，英语四六级，普通话证，电工上岗证，技工证等等职业资格。））\r\n\r\n郑重承诺：一次收费，不再收后续其他任何费用，考试不通过全额退费！！！','1441036800','1441613313','1444205313','1441613313','0','0','','2','1','2','大专、本科学历报名即将截止 联盟教育咨询有限公司  成人高等教育大专、本科学历（学信网可查） 大专00 本科00 科学00 学历00 报名00 即将00 截止00 联盟00 教育00 咨询00 有限00 公司00 成人00 高等00 人教00 河南00 河南省0 郑州00 郑州市0 州市00 国家00 承认00 高考00 专升本0 开始00 火热00 单位00 职称00 升职00 提升00 升学00 必须00 轻轻00 轻松00 证书00 不要00 等到00 急需00 成为00 遗憾00 即日00 日起00 考前00 培训00 教材00 培训班0 高校00 涵盖00 各种00 专业00 自己00 一个00 机会00 尝试00 更好00 招生00 对象00 专科00 起点00 初中00 高中00 中专00 报考00 条件00 提供00 本人00 人身00 身份00 身份证0 毕业00 毕业证0 以上00 复印00 复印件0 只需00 个人00 资料00 最高00 高学00 按照00 教育部0 规定00 考生00 国民00 教育系0 时间00 截止日0 日期00 地址00 中原00 中原区0 秦岭00 万达00 交费00 流程00 预交00 培训费0 领取00 复习00 招办00 所在00 所在区0 采集00 信息00 参加00 加入00 入学00 考试00 公布00 分数00 录取00 结果00 学费00 我们00 优势00 超强00 资讯00 先人00 汇集00 优秀00 考考00 教授00 全面00 系统00 系统性0