INSERT INTO `qs_course` VALUES ('1462','10','69690','武汉果汁系列培训及加盟','2','武汉一品香特色小吃培训','21','14','餐饮培训','1880','随到随学','0','','18','0','湖北省','开店者，创业者，想学技术者，下岗者等。。','','50','1700','1500','一、果汁\r\n最新时尚理念，教学方式：根据报名学习内容，由专职老师示范、讲解操作要领，再由学员亲手操作，掌握产品的制作流程，全程完成产品的制作。一次培训后，公司与您建立长期友好合作关系，共享优质资源，共赢发展；欢迎加入我们的团队，让创业从零风险开始！\r\n武汉果汁培训丨授课内容\r\n1、果汁基础 2、鲜调果汁 3、优活果C系列 4、鲜果爽 5、果滋味 6、爆炸果汁 7、柠檬优V 8、冰果露 9、雪顶果饮 10、酷思果泥 11、水晶果冻 12、鲜榨果汁 13、滋味鲜榨果汁 14、专供鲜榨果汁 15、鲜牛奶乳系列 16、新品系列1 17、新品系列2 18、小吃零食培训\r\n 鲜榨果汁功效\r\n西瓜汁：暑天利尿、消炎、降血压。\r\n芒果汁：助消化，防昏船呕吐，缓解喉咙疼痛。\r\n菠萝汁：可去肿、消食，治肾炎、咽炎。\r\n葡萄汁：有利尿、补血安神、强肾肝的功能。\r\n苹果汁：调理肠胃，可助肾机能，防高血压。\r\n香蕉汁：健肌肉、润肺、通血脉。\r\n橙子汁：可化痰、健胃，防心脏病和中风。\r\n柚子汁：降胆固醇，防感冒，止咳化痰。\r\n柠檬汁：化咳止痰，有助排除体内毒素。\r\n椰子汁：防心脏病，可健肤、止咳。\r\n木瓜汁：止咳润肺，帮助消化蛋白质。\r\n武汉果汁培训丨培训费用\r\n1500元，包含技术转让费、中餐费、学习材料费、资料费等，中途不收任何费用。\r\n武汉果汁培训丨学习时间\r\n不限学习时间，学会为止，包教包会。一般3至5天左右，根据个人掌握情况而定。\r\n武汉果汁培训丨教学方式\r\n根据报名学习内容，由专职老师示范、讲解操作要领，再由学员亲手操作，掌握产品的制作流程，全程完成产品的制作。\r\n武汉果汁培训丨开店指导\r\n1 店面形象设计指导：具体店面布局设计、装修设计、店面招牌、店面灯箱。\r\n2 根据店面特点、地理位置及消费人群制定详细营销战略及促销计划。\r\n3 根据各店具体情况，制定店面投资预算分析及投资风险回避。\r\n4 各店菜单的定价参考及设计。\r\n5 果汁饮品制作的设备及工具。','0','1439200077','1470736077','1440751700','0','0','','1','1','3','武汉果汁系列培训及加盟 武汉一品香特色小吃培训  武汉00 果汁00 系列00 培训00 加盟00 一品00 特色00 小吃00 餐饮00 湖北00 湖北省0 最新00 时尚00 理念00 教学00 方式00 根据00 报名00 名学00 学习00 内容00 专职00 老师00 示范00 讲解00 操作00 要领00 学员00 亲手00 掌握00 产品00 制作00 流程00 全程00 完成00 一次00 公司00 建立00 长期00 友好00 合作00 关系00 共享00 优质00 资源00 共赢00 发展00 欢迎00 加入00 我们00 团队00 创业00 风险00 开始00 授课00 基础00 鲜果00 滋味00 爆炸00 柠檬00 水晶00 果冻00 鲜牛奶0 牛奶00 新品00 品系00 零食00 功效00 西瓜00 利尿00 血压00 芒果00 助消化0 消化00 呕吐00 缓解00 喉咙00 疼痛00 菠萝00 肾炎00 咽炎00 葡萄00 葡萄汁0 有利00 补血00 安神00 功能00 苹果00 调理00 肠胃00 机能00 高血压0 香蕉00 肌肉00 润肺00 血脉00 橙子00 化痰00 心脏00 心脏病0 中风00 柚子00 胆固醇0 感冒00 有助00 排除00 体内00 毒素00 椰子00 椰子汁0 木瓜00 帮助00 蛋白00 蛋白质0 培训费0 费用00 包含00 技术00 转让00 转让费0 中餐00 餐费00 材料00 材料费0 资料00 资料费0 中途00 任何00 时间00 学会00 为止00 一般00 左右00 个人00 情况00 开店00 指导00 店面00 形象00 设计00 具体00 布局00 装修00 招牌00 灯箱00 特点00 地理00 位置00 消费00 人群00 制定00 详细00 营销00 战略00 促销00 计划00 投资00 预算00 分析00 回避00 菜单00 定价00 参考00 饮品00 设备00 设备及0 工具00',