INSERT INTO `qs_course` VALUES ('1379','6','69710','心理咨询师包过班','2','重庆市远景职业培训学校','131','27','其他资格培训','1883','周末班','0','','4','0','重庆市','大众人群','全国统考职业资格证','200','0','0','随着社会竞争的加剧，人们的心理压力越来越大，对心理咨询、心理辅导的需要越来越迫切。心理咨询作为一种通过科学方法和手段提供有效的心理帮助的专业活动，将成为我国新世纪的十大热门职业之一，但我国受过专业培训的心理咨询师奇缺。本中心致力于系统传授心理学知识和成功的咨询经验，通过课堂讲授、小组辅导、案例分析、现场督导、职业规划，培养具有全面的心理学知识和心理测量、心理诊断、心理咨询、康复引导以及职业管理的专业人才。严格按照国家标准培训，确保教学质量，注重应用能力培养。我们的目标在于培养职业化的心理咨询师业界精英并证明其自身价值。\r\n【招生对象及职业方向】\r\n医务工作者、教育工作者、高校高年级学生、企业人力资源管理人员、新闻工作者、企事业单位从事思想政治工作的管理者、军队心理学工作者以及有志于从事心理咨询职业工作的社会各界人士。','1437753600','1438832842','1441424842','1439086813','0','0','','1','1','15','心理咨询师包过班 重庆市远景职业培训学校  全国统考职业资格证 心理00 心理咨询师 咨询00 咨询师0 重庆00 远景00 职业00 培训00 学校00 全国00 统考00 资格00 资格证0 其他00 随着00 社会00 竞争00 加剧00 人们00 压力00 越来越0 辅导00 需要00 迫切00 作为00 通过00 科学00 方法00 手段00 提供00 有效00 帮助00 专业00 活动00 成为00 我国00 新世纪0 世纪00 十大00 热门00 之一00 受过00 奇缺00 中心00 致力00 致力于0 系统00 传授00 心理学0 理学00 知识00 和成00 成功00 经验00 课堂00 讲授00 小组00 案例00 分析00 现场00 督导00 规划00 培养00 具有00 全面00 面的00 和心00 测量00 诊断00 康复00 引导00 以及00 管理00 人才00 严格00 按照00 国家00 标准00 确保00 教学00 质量00 注重00 应用00 能力00 我们00 目标00 在于00 职业化0 业界00 精英00 证明00 自身00 身价00 价值00 招生00 对象00 方向00 医务00 务工00 工作00 工作者0 作者00 教育00 高校00 高年级0 年级00 学生00 企业00 人力00 人力资源 资源00 管理人0 管理人员 人员00 新闻00 企事业0 事业00 单位00 从事00 思想00 政治00 管理者0 军队00 学工00 有志00 有志于0 各界00 人士00','心理咨询师包过班,重庆市远景职业培训学校,,全国统考职业资格证','','106.469208','29.565954','1','2','0');
INSERT INTO `qs_course` VALUES ('1380','0','69699','郑州专业培训班  郑州哪有专业景观设计培训班','2','郑州景尚景观设计有限公司','89','20','其他技能培训','1881','白天班','0','','17','278','河南省/郑州市','大学生、社会工作者,以及想从事室内、景观行业的人士,我们给提供良好的学习平台,我们不仅仅培训从事行业','','3个月','6000','5300','郑州专业培训班  郑州哪有专业景观设计培训班  景观设计培训班  景观设计师培训班\r\n\r\n第5期景观设计师培训班正式开班 景观设计师招生简(郑州校区）\r\n一、培养对象\r\n   本科大学生  专科大学生以及想在景观设计发展的同学，我们给提供良好的学习平台，不仅仅体现在工作上，还体现在生活上，我们不仅仅是一个培训会做方案、软件的人才，我们还培养个人的素质，设计师素质问题。\r\n二、开设的课程\r\n    1、景观软件基础培训-----景观设计师需要的软件\r\n    景观植物配置\r\n    景观施工图\r\n    景观施工工艺\r\n    方案、平面图、植物配置、效果图su 3d等等一些景观需要的软件。\r\n    2、设计师素质的培养-----设计师不仅仅会做设计，还要注意设计师需要注重哪些个人的素质。\r\n    3、景观设计师的思路的形成---作为一个设计师要有一个良好的思路和强有力的大脑，来支持你在景观方面的创造\r\n    4、方案设计的思路-----现在很多的大学生，和工作一两年的人群还是摸索不到学景观的方法以及一些机构只教教软件根本不考虑学生在社会上生存的技巧。\r\n    5、谈单的技巧--------这个是景观学习的重点之一，这里没有奢华的语言没有华丽的外表，就用你朴实的心打动客户，同时给公司和你自己带来利益。\r\n    6、国学文化的培养----这一点大家都忽视掉了，国学文化是我们祖先留下的文化遗产，我们要好好利用起来，这能使你认识到什么是价值观 人生观和价值观\r\n    7、景观设计师知识量的补充--景观设计师需要更多的知识来维持你创造的才能，这需要不断的去补充知识才能达到设计师的才能。\r\n三、开课时间-随到随学\r\n   ――景观免费大特训，到时候需要入场券，请联系我，下方的联系方式\r\n   ----景观设计师培训班正式开课，初步对学员进行了解，制定一对一教学的方案，我们的课程是环环相扣的。\r\n四、微信公众号为ww_texun  加qq3227723966或加群  344142524','0','1438833246','1441425246','1438833246','0','0','','1','1','29','郑州专业培训班  郑州哪有专业景观设计培训班 郑州景尚景观设计有限公司 郑州00 专业00 培训00 培训班0 景观00 景观设计 设计00 有限00 公司00 其他00 技能00 河南00 河南省0 郑州市0 州市00 景观设计师 设计师0 师培00 正式00 开班00 招生00 校区00 培养00 对象00 本科00 科大00 大学00 大学生0 学生00 专科00 以及00 计发00 发展00 同学00 我们00 提供00 良好00 学习00 平台00 不仅00 不仅仅0 仅仅00 体现00 现在00 工作00 生活00 一个00 培训会0 方案00 软件00 人才00 个人00 素质00 质问00 问题00 开设00 课程00 基础00 需要00 植物00 配置00 施工00 施工图0 工艺00 平面00 平面图0 效果00 效果图0 等等00 一些00 还要00 注意00 注重00 哪些00 思路00 形成00 作为00 强有力0 有力00 大脑00 支持00 方面00 面的00 创造00 一两00 人群00 还是00 摸索00 不到00 方法00 机构00 根本00 考虑00 社会00 会上00 生存00 技巧00 这个00 重点00 之一00 这里00 没有00 奢华00 语言00 华丽00 外表00 朴实00 打动00 客户00 同时00 公司和0 自己00 带来00 利益00 国学00 学文00 文化00 一点00 大家00 忽视00 祖先00 留下00 遗产00 要好00 好好00 利用00 起来00 认识00 什么00 价值00 价值观0 人生00 人生观0 知识00 补充00 更多00 维持00 才能00 要不00 不断00 达到00 开课00 课时00 时间00 免费00 到时00 到时候0 时候00 入场00 入场券0 联系00 下方00 方式00 