INSERT INTO `qs_course` VALUES ('1340','0','69679','网店全能就业班(零基础推荐就业)课程','2','嘉兴市明德职业技能培训学校','129','11','IT培训','1880','随到随学','0','','12','216','浙江省/嘉兴市','对电子商务行业感兴趣，想系统的学习一整套电商知识并长期从事该行业的人。零基础亦可！','学校颁发的结业证书','288','5600','0','师资优势：资深的电商专业老师，有常年的淘宝开店基础和美工、推广实战经验。年培训学员都在千人以上，并有自己的实战平台可以给学员进行演示。注重实战，针对性强。\r\n每个班级都有专门的QQ群和微信群，可以和老师及时交流解答！\r\n就业推荐：培训结束，进行鉴定考核，成绩优秀者学校免费推荐就业。\r\n工作内容：负责网店的整体运营，从开店到装修到推广一整套的运营流程！\r\n工作方向：开展各类电子商务业务，有电子商务人才需求的电商企业或可独立创业！\r\n课程大纲\r\n所设课程	课程内容\r\n淘宝创业培训班\r\n（单科：1000元）\r\n电子商务从业心态与淘宝规则；图片处理工具与技巧；阿里旺旺与支付宝的使用；标题优化、关键字比重；买家中心，数据分析；发布宝贝；店铺装修模板；店铺推广，直通车；客服技巧；天猫商城；店招的制作；增加销量的小技巧\r\n课时：10天\r\n收获：淘宝网开店整个流程系统教学，知识点讲解透彻，平台实战，实战性强。\r\n网店美工设计专才班\r\n（单科：3200元）\r\nPhotoShop图片处理软件系统教学，Dreamwere网页代码软件系统教学，Coreldraw图形图像软件系统教学（三大设计核心软件），电商摄影，色彩构成，颜色运用，视觉营销，店铺首页、详情页整体设计。\r\n课时：45天\r\n收获：3大核心设计软件的熟练运用，用色的技巧，店铺整体设计的技巧和统一性搭配技巧。\r\n网店推广运营班\r\n（单科：2000元）\r\n营销理论指导、淘宝销售额公式及影响搜索排名的因素 ；整盘优化提高转化率、标题优化、主图优化、详情页优化、店铺优化；直通车的使用大量引流、影响质量得分的因素及质量得分的提高；站外推广巧用免费流量、外网推广、分享网站及威客的使用；打造爆款提升店铺排名、爆款的选款、测款及爆款的关联营销；大型活动的报名及策划提升品牌形象、淘宝营销导航的使用、活动报名、聚划算规则。\r\n课时：7-8天\r\n收获：店铺整体数据的分析和监管，店铺推广技巧的运用，直通车的运用，搜索优化，淘宝客的运用，爆款的策划。','0','1438668825','1446444825','1438668825','0','0','','1','1','8','网店全能就业班(零基础推荐就业)课程 嘉兴市明德职业技能培训学校  学校颁发的结业证书 全能00 就业00 就业班0 零基00 基础00 推荐00 课程00 嘉兴00 明德00 职业00 技能00 培训00 学校00 颁发00 结业00 结业证0 证书00 IT000 浙江00 浙江省0 师资00 优势00 资深00 电商00 专业00 老师00 常年00 开店00 和美00 美工00 推广00 实战00 经验00 学员00 以上00 并有00 自己00 战平00 平台00 可以00 进行00 演示00 注重00 针对00 针对性0 每个00 班级00 专门00 及时00 交流00 解答00 结束00 鉴定00 考核00 成绩00 绩优00 优秀00 优秀者0 免费00 工作00 内容00 负责00 整体00 运营00 装修00 整套00 流程00 方向00 开展00 各类00 电子00 电子商务 商务00 业务00 有电子0 人才00 需求00 商企00 企业00 独立00 创业00 大纲00 培训班0 从业00 业心00 心态00 规则00 图片00 图片处理 处理00 理工00 工具00 技巧00 阿里00 支付00 使用00 标题00 优化00 关键00 关键字0 比重00 买家00 家中00 中心00 数据00 数据分析 分析00 发布00 宝贝00 店铺00 铺装00 模板00 直通00 直通车0 通车00 客服00 商城00 制作00 增加00 销量00 收获00 整个00 系统00 教学00 知识00 知识点0 讲解00 透彻00 网店美工 美工设计 设计00 专才00 软件00 网页00 代码00 图形00 图像00 三大00 核心00 摄影00 色彩00 构成00 颜色00 运用00 视觉00 营销00 首页00 详情00 课时00 熟练00 统一00 统一性0 搭配00 网店推广 理论0