INSERT INTO `qs_course` VALUES ('1343','0','69699','郑州景观设计培训班','2','郑州景尚景观设计有限公司','89','20','其他技能培训','1881','白天班','0','','17','0','河南省','招生对象：在校大学生，景观 、室内等有关软件学校的人员','','3个月','1200','1000','郑州景观设计培训班\r\n\r\n        郑州景尚景观设计培训班创建于2014年8月份，迄今为止1年多，主要立足于郑州景观设计培训，往社会输送了很多人才。\r\n\r\n创办的理由\r\n\r\n        郑州景尚景观设计培训班创始人尚魏 ，毕业于华北水利水电大学，建筑学院、景观设计专业。\r\n\r\n       在大学期间他是一个不安分的学生，挂科无数，他觉得在大学学不到东西。他就冒着挂科的危险来到了郑州北环学习软件，学到一定的程度，就学不到什么东西了，像3d PS su lumion 等有关于景观设计的软件，花掉了自己一年所有的生活费。然后进入公司实习，许多公司都不要没有毕业的应届生，投了无数的简历，投递了许多作品，如沉入海底一般，那些简历和作品有去无回啊。\r\n\r\n      反思自己之后觉得自己的能力不行，然后找培训班进行学习，找遍了整个郑州没有一个他想学的东西，这些培训班只是教一下基础然后收了钱就不管了，他很气愤，然后到广州、北京、上海去学习景观的知识。\r\n\r\n      回到学校他关了很多的科，一一的补回来，以优秀的成绩完成学业，让自己在学习生涯画上一个完美的句号。\r\n\r\n     多年以后，辞去待遇很好的工作，开始他自己的创业之路，他在郑东新区祭城庙张小区南院租了个房子而且给工作室起了个名字   郑州景尚景观设计培训班  。\r\n\r\n   尚魏的想法\r\n\r\n     给大学生提供很好的平台，能让大学生毕业之后能找到很好的工作，能在这培训班里出来的学生直接能应聘设计公司的某个职位。不让大学生迷茫、彷徨、等待。让每一个大学生有一个更好的未来。','1439568000','1438671913','1441263913','1438671913','0','0','','1','1','8','郑州景观设计培训班 郑州景尚景观设计有限公司  郑州00 景观00 景观设计 设计00 培训00 培训班0 有限00 公司00 其他00 技能00 河南00 河南省0 迄今00 为止00 主要00 立足00 社会00 输送00 多人00 人才00 创办00 理由00 创始00 创始人0 毕业00 华北00 水利00 水利水0 水电00 电大00 大学00 建筑00 建筑学0 学院00 专业00 学期00 期间00 一个00 不安00 安分00 学生00 无数00 觉得00 学学00 不到00 东西00 危险00 来到00 学习00 软件00 学到00 一定00 程度00 就学00 什么00 有关00 关于00 花掉00 自己00 所有00 有的00 生活00 生活费0 然后00 后进00 进入00 实习00 许多00 不要00 没有00 应届00 应届生0 简历00 投递00 作品00 沉入00 海底00 一般00 那些00 作品有0 反思00 之后00 能力00 不行00 进行00 整个00 这些00 只是00 基础00 不管00 气愤00 广州00 北京00 上海00 知识00 回到00 学校00 一一00 回来00 优秀00 成绩00 完成00 学业00 在学00 生涯00 完美00 美的00 句号00 多年00 以后00 辞去00 待遇00 工作00 开始00 创业00 郑东00 新区00 小区00 房子00 而且00 工作室0 名字00 想法00 大学生0 提供00 平台00 找到00 班里00 出来00 直接00 应聘00 某个00 职位00 不让00 迷茫00 彷徨00 等待00 更好00 未来00','郑州景观设计培训班,郑州景尚景观设计有限公司,,','','113.779843','34.788224','1','1','0');
