INSERT INTO `qs_course` VALUES ('1345','0','69679','会计初级职称','2','嘉兴市明德职业技能培训学校','129','11','IT培训','1880','随到随学','0','','12','216','浙江省/嘉兴市','想从事于会计方面工作的人','省认证证书，全国通用','90','1240','0','初级会计职称又名初级会计师，是会计职称的一种，会计职称分为会计初级职称、会计中级职称、会计高级职称。会计职称是衡量一个人会计人员业务水平高低的基本标准，会计职称越高，表明你会计业务水平越高，也是加薪的必备宝典。面对会计行业低端人才饱和，中高级人才明显匮乏的现状，许多明智的财会人员，纷纷参加会计职称考试，提高自身素质及能力，来应对越来越激烈的职场竟争。\r\n明德学校会计培训针对初级会计职称现状及结合自身优势，特开设初级会计职称培训班，旨在为广大学员提供更好的就业前景。\r\n一、多重保障 取证志在必得\r\n1：课程安排：从零学起，超长课时，是一般培训学校的2倍\r\n2：名师辅导：资深讲师团，配备专业的助教班主任跟踪学习情况\r\n3：配套题库：有针对性的题库，加强记忆，提高成绩\r\n4：考试系统：无纸化考试系统，在家都可以模拟考试\r\n5：考前辅导：重点、难点解析，加深印象','0','1438672778','1446448778','1438673332','0','0','','1','1','8','会计初级职称 嘉兴市明德职业技能培训学校  省认证证书，全国通用 会计00 初级00 职称00 嘉兴00 明德00 职业00 技能00 培训00 学校00 认证00 证书00 全国00 通用00 IT000 浙江00 浙江省0 又名00 会计师0 分为00 中级00 高级00 衡量00 一个00 个人00 会计人员 人员00 业务00 水平00 高低00 基本00 标准00 表明00 会计业0 必备00 宝典00 面对00 行业00 低端00 人才00 饱和00 中高00 中高级0 才明00 明显00 匮乏00 现状00 许多00 明智00 财会00 财会人员 纷纷00 参加00 考试00 提高00 自身00 素质00 能力00 应对00 越来越0 激烈00 职场00 竟争00 针对00 结合00 优势00 开设00 培训班0 旨在00 广大00 大学00 学员00 提供00 更好00 就业00 前景00 多重00 保障00 取证00 志在00 课程00 安排00 超长00 课时00 一般00 名师00 辅导00 资深00 讲师00 讲师团0 师团00 配备00 专业00 助教00 班主00 班主任0 主任00 跟踪00 学习00 情况00 配套00 题库00 针对性0 加强00 记忆00 高成00 成绩00 系统00 无纸化0 在家00 可以00 模拟00 考前00 重点00 难点00 解析00 加深00 印象00','会计初级职称,嘉兴市明德职业技能培训学校,,省认证证书，全国通用','','120.769908','30.772647','1','1','0');
INSERT INTO `qs_course` VALUES ('1346','0','69679','会计中级职称','2','嘉兴市明德职业技能培训学校','129','20','其他技能培训','1880','随到随学','0','','12','216','浙江省/嘉兴市','想从事于会计方面工作的人','省证书，全国通用','108','1960','0','会计中级职称又名中级会计师，是会计职称的一种，会计职称分为会计初级职称、会计中级职称、会计高级职称。会计职称是衡量一个人会计人员业务水平高低的基本标准，会计职称越高，表明你会计业务水平越高，也是加薪的必备宝典。面对会计行业低端人才饱和，中高级人才明显匮乏的现状，许多明智的财会人员，纷纷参加会计职称考试，提高自身素质及能力，来应对越来越激烈的职场竟争。\r\n明德学校会计培训针对中级会计职称现状及结合自身优势，特开设中级会计职称培训班，旨在为广大学员提供更好的就业前景。\r\n一、多重保障 取证志在必得\r\n1：课程安排：从零学起，超长课时，是一般培训学校的2倍\r\n2：名师辅导：资深讲师团，配备专业的助教班主任跟踪学习情况\r\n3：配套题库：有针对性的题库，加强记忆，提高成绩\r\n4：考试系统：无纸化考试系统，在家都可以模拟考试\r\n5：考前辅导：重点、难点解析，加深印象\r\n三、报考条件\r\n持有会计从业资格证书。且必须具备下列条件之一：\r\n（1）取得大学专科学历，从事会计工作满五年。\r\n（2）取得大学本科学历，从事会计工作满四年。\r\n（3）取得双学士学位或研究生班毕业，从事会计工作满二年。\r\n（4）取得硕士学位，从事会计工作满一年。\r\n（5）取得博士学位。','0','1438673005','1446449005','1438673005','0','0','','1','1','1','会计中级职称 嘉兴市明德职业技能培训学校  省证书，全国通用 会计00 中级00 职称00 嘉兴00 明德00 职业00 技能00 培训00 学校00 证书00 全国00 通用00 其他00 浙江00 浙江省0 又名00 会计师0 分为00 初级00 高级00 衡量00 一个00 个人00 会计人员 人员00 业务00 水平00 高低00 基本00 标准00 表明00 会计业0 必备00 宝典00 面对00 行业00 低端00 人才00 饱和00 中高00 中高级0 才明00 明显00 匮乏00 现状00 许多00 明智00 财会00 财会人员 纷纷00 参加00 考试00 提高00 自身00 素质00 能力00 应对00 越来越0 激烈00 职场00 竟争00 针对00 结合00 优势00 开设00 培训班0 旨在00 广大00 大学00 学员00 提供00 更好00 就业00 前景00 多重00 保障00 取证00 志在00 课程00 安排00 超长00 课时00 一般00 名师00 辅导00 资深00 讲师00 讲师团0 师团00 配备00 专业00 助教00 班主00 班主任0 主任00 跟踪00 学习00 情况00 配套00 题库00 针对性0 加强00 记忆00 高成00 成绩00 系统00 无纸化0 在家00 可以00 模拟00 考前00 重点00 难点00 解析00 加深00 印象00 报考00 条件00 持有00 从业00 资格00 资格证0 必须00 具备00 下列00 之一00 取得00 专科00 科学00 学历00 从事00 工作00 本科00 双学00 学士00 士学位0 学位00 研究00 研究生0 毕业00 硕士00 博士00','会计中级职称,嘉兴市明德职业技能培训学校,,省证书，全国通用','','120.769908','30.772647','1','1','0');
