INSERT INTO `qs_course` VALUES ('1349','0','69626','润滑培训  润滑管理课程  润滑技术培训','2','北京中科智谷机电技术研究院','128','20','其他技能培训','1881','白天班','0','','2','0','上海市','主管设备和生产的企业领导、企业高、中层设备管理人员、设备维修、润滑、油品采购 和使用部门主管及相关业','结业证书','13','3200','3000','一、树立对设备润滑的新认识\r\n二、正确选择是搞好设备润滑的首要环节\r\n三、油脂的正确采购和科学存储是搞好设备润滑的基础\r\n1、正确购油的原则（购进油品必须经过检验 尽量购名牌、大油厂产品 专油专具\r\n2、采购油品的常见误区（价格至上只认廉价油品 盲目迷信“洋油”）\r\n3、油脂的保质期确定\r\n4、润滑油品的运输与存放\r\n四、油脂的正确加注、使用与维护是搞好设备润滑的关键\r\n1、设备润滑方式的选择（适用性及注意事项、要领）\r\na手工加油 b滴油加油c飞溅润滑d油垫、油环润滑e强制润滑f油雾润滑\r\n2、先进润滑方法介绍\r\na先进的油气润滑b智能干油润滑自动化加油系统\r\n3、油品劣化的主要形式及处理方法\r\na运行中油品蒸发、氧化 b汽体污染 c软颗粒污染（漆膜） d水污染\r\ne混油污染 f超温使用 g固体颗粒物污染 h金属催化 i错代油\r\n4、油品劣化的迹象判断、产生原因、及油品劣化的防范\r\na理化指标出现异常b性能指标出现异常c超油品承受负荷运行d超油品承受速度运行 \r\ne超油品耐介质范筹应用f加油脂期过长或过短g加油量过大和过小\r\n5、设备运行中的润滑油品监测\r\na常规理化指标监测 b精、大、稀、关设备的油液综合状态监测\r\nc参考界限值 d部份企业的监测样表\r\n6、油品的康复处理\r\na润滑装置及管路清洗 b油品净化和过滤\r\nc企业换下的所谓废油90％的都可康复处理,真正废油不超10％\r\nd根据企业工况,对症选好净油设备。\r\n五、加强管理是搞好设备润滑的重要保障\r\n1、提{认识，重新定位润滑在企业设备管理的位置\r\n2、确定润滑管理方针、目标，并建立相应机构制度\r\n3、配备和培养润滑技木人员\r\n4、设立润滑站和化验室,有条件建立油液监测中心\r\n5、编制润滑图表和润滑技术服务手册\r\n6、润滑五步管理法介绍\r\n六、润滑系统的维护\r\n1、 清洁度是液压润滑系统的关键参数 2、使用、维修时控制污染的方法\r\n3、 选择过滤器、净油机的要点 4、 常见过滤方法及其优缺点\r\n5、 如何正确清洗润滑装置及管道','1441814400','1438682899','1447322899','1441613830','0','0','','1','1','19','润滑培训  润滑管理课程 润滑技术培训 北京中科智谷机电技术研究院 结业证书 润滑00 培训00 管理00 管理课0 课程00 技术00 北京00 中科00 机电00 研究00 研究院0 结业00 结业证0 证书00 其他00 技能00 上海00 上海市0 树立00 设备00 认识00 正确00 选择00 搞好00 首要00 环节00 油脂00 采购00 科学00 存储00 基础00 原则00 购进00 油品00 必须00 经过00 检验00 尽量00 名牌00 油厂00 产品00 常见00 误区00 价格00 至上00 廉价00 盲目00 迷信00 保质00 保质期0 确定00 润滑油0 运输00 存放00 加注00 使用00 维护00 关键00 方式00 适用00 适用性0 注意00 事项00 要领00 手工00 加油00 飞溅00 强制00 先进00 方法00 介绍00 油气00 智能00 能干00 自动00 自动化0 系统00 劣化00 主要00 形式00 处理00 运行00 中油00 蒸发00 氧化00 污染00 颗粒00 漆膜00 水污染0 油污00 固体00 颗粒物0 金属00 催化00 迹象00 判断00 产生00 原因00 防范00 理化00 指标00 标出00 出现00 异常00 性能00 承受00 负荷00 速度00 介质00 应用00 过长00 大和00 监测00 常规00 综合00 状态00 参考00 界限00 企业00 康复00 装置00 管路00 清洗00 净化00 过滤00 根据00 工况00 对症00 加强00 重要00 保障00 重新00 定位00 设备管理 位置00 管理方0 方针00 目标00 并建00 建立00 相应00 机构00 制度00 配备00 培养00 人员