INSERT INTO `qs_course` VALUES ('1354','0','69679','出纳实务班','2','嘉兴市明德职业技能培训学校','129','20','其他技能培训','1880','随到随学','0','','12','216','浙江省/嘉兴市','零基础，想从事出纳工作的人','学校颁发的结业证书','18','550','0','课程性质和任务\r\n《出纳实务》是会计专业的一门基础学科。本课程主要学习出纳核算工作的基本原理、基本方法和基本技能。学好这门课程，能使学员掌握出纳工作与会计工作的区别与联系。本校在教学中注意对学员基础技能的培养，如点钞技术、伪钞识别技术、原始凭证与记账凭证的填制、出纳日记账的填制等。\r\n出纳工作真的很简单吗？\r\n出纳是“三分动手、七分动脑”的专业工作。没有参加过系统的出纳培训和学习出纳实操的人们，常将出纳工作简单地形容为 “跑跑银行，记记账”，这是盲人摸象的表现。遗憾的是，这些\r\n对出纳培训和出纳工作的片面认识还在不断地误导着单位领导者、现职出纳、初学者和财务教育工作者。\r\n其实，所谓出纳工作的“跑跑银行，记记账”，只是出纳的“三分动手”的部分，而需要动脑的“七分”却常被人忽略。在以往和现职出纳人员的实际工作中，大量地出纳工作差错、财务事故甚至损害案件，都出在那“七分”里。这些问题反映出没有经过系统的出纳培训，缺乏专业意识和能力。\r\n只有参加过系统地出纳培训和学习出纳实操，并能够在实际的出纳工作中从容应对各项繁杂事务的出纳人员才有资格说：出纳很简单。而对于既没有参加过出纳培训和学习出纳实操，也没有\r\n从事出纳工作的朋友来说，不该想当然地以为，对自己来说出纳工作也是很简单的，从而误导了自己对出纳职业的基本判断。\r\n以上教学体系由明德学校团队研发，知识产权归明德学校所有，侵权必究！','0','1438743114','1446519114','1438743114','0','0','','1','1','1','出纳实务班 嘉兴市明德职业技能培训学校  学校颁发的结业证书 出纳00 实务00 嘉兴00 明德00 职业00 技能00 培训00 学校00 颁发00 结业00 结业证0 证书00 其他00 浙江00 浙江省0 课程00 性质00 任务00 会计00 专业00 基础00 学科00 主要00 学习00 核算00 工作00 基本00 本原00 原理00 本方00 方法00 学好00 学员00 掌握00 与会00 区别00 联系00 本校00 教学00 注意00 培养00 点钞00 技术00 伪钞00 识别00 原始00 凭证00 记账00 填制00 日记00 真的00 简单00 三分00 动手00 动脑00 没有00 参加00 系统00 人们00 地形00 形容00 银行00 这是00 盲人00 表现00 遗憾00 这些00 片面00 认识00 不断00 误导00 单位00 领导00 领导者0 现职00 初学00 学者00 财务00 教育00 工作者0 作者00 其实00 所谓00 只是00 部分00 需要00 忽略00 以往00 出纳人员 人员00 实际00 大量00 差错00 事故00 甚至00 损害00 案件00 问题00 反映00 映出00 出没00 经过00 缺乏00 意识00 能力00 只有00 能够00 从容00 应对00 各项00 繁杂00 杂事00 事务00 资格00 对于00 从事00 朋友00 来说00 不该00 想当然0 当然00 以为00 自己00 说出00 从而00 判断00 以上00 体系00 团队00 研发00 知识00 产权00 所有00 侵权00','出纳实务班,嘉兴市明德职业技能培训学校,,学校颁发的结业证书','','120.769908','30.772647','1','1','0');
INSERT INTO `qs_course` VALUES ('1355','0','69679','财务软件实务班','2','嘉兴市明德职业技能培训学校','129','20','其他技能培训','1880','随到随学','0','','12','216','浙江省/嘉兴市','从事财务方面工作的新人','学校颁发的结业证书','12','550','0','《财务会计软件应用》是一门实践性很强也是十分实用的课程。通过本课程可以加强学员对会计基本理论的理解、对会计基本方法的运用及对基本操作技能的训练；同时在实践中将会计专业理论和实务有机地结合在一起，能够使学员对会计工作的认识加深，也培养了学员严谨的工作态度和敬业精神。所以，本课程的开设为学员走上工作岗位后，缩短“适应期”，胜任工作打下坚实的基础。\r\n一、本课程讲授的基本理论\r\n1．财务软件基础原理和基本方法的介绍；\r\n2．我国现行财务软件功能基本结构、财务软件处理流程及操作特点。\r\n3．利用财务软件为企业内外部提供会计信息的方法。\r\n二、本课程学生应达到的能力\r\n1、通过本实践，使学员能够系统地、全面地掌握现流行财务软件的基本操作程序和具体方法，加深学员必需的基础知识和基本理论的理解。\r\n2、能够熟练运用财务软件系统解决会计核算及财务分析问题。\r\n3、提高学生实际动手能力以及分析问题解决问题的能力。\r\n三、要求\r\n1、由教师逐步指导整个操作流程。\r\n2、具体实践步骤和实际数据处理由学生独立完成。\r\n3、学员之间可以互相探讨交流','0','1438743272','1446519272','1438743272','0','0','','1','1','1','财务软件实务班 嘉兴市明德职业技能培训学校  学校颁发的结业证书 财务00 软件00 实务00 嘉兴00 明德00 职业00 技能00 培训00 学校00 颁发00 结业00 结业证0 证书00 其他00 浙江00 浙江省0 财务会计 会计00 应用00 实践00 实践性0 十分00 实用00 课程00 通过00 可以00 加强00 学员00 基本00 理论00 理解00 本方00 方法00 运用00 操作00 训练00 同时00 中将00 专业00 有机00 结合00 一起00 能够00 工作00 认识00 加深00 培养00 严谨00 态度00 敬业00 精神00 所以00 开设00 走上00 上工00 岗位00 缩短00 适应00 适应期0 胜任00 打下00 坚实00 基础00 讲授00 原理00 介绍00 我国00 现行00 功能00 结构00 处理00 流程00 特点00 利用00 企业00 业内00 业内外0 内外00 内外部0 外部00 提供00 信息00 学生00 达到00 能力00 系统00 全面00 掌握00 流行00 程序00 具体00 必需00 知识00 熟练00 解决00 会计核算 核算00 财务分析 分析00 问题00 提高00 高学00 实际00 动手00 以及00 题解00 要求00 教师00 逐步00 指导00 整个00 步骤00 数据00 理由00 独立00 完成00 之间00 互相00 探讨00 交流00','财务软件实务班,嘉兴市明德职业技能培训学校,,学校颁发的结业证书','','120.769908','30.772647','1','1','0');
INSERT INTO `qs_course` VALUES ('1356','0','69679','视觉营销店铺美工专题','2','嘉兴市明德职业技能培训学校','129','11','IT培训','1883','周末班','0','','12','216','浙江省/嘉兴市','对店铺装修存在疑问想提升店铺装修能力，提升店铺转化率的学员！','学校颁发的结业证书','12','1880','0','网店美工视觉营销--孙老师教你如何做好淘宝网店视觉营销\r\n品牌视觉、产品视觉、营销视觉是一个完整的体系！\r\n买家为何记不住你的店铺？那一定是品牌视觉出现了问题！\r\n在网上卖产品就是卖图片，一样的产品，为什么销量千差万别？首先要考虑的是不是产品描述出现了问题？如何通过产品描述策划，提升品牌形象和店铺形象，提高单品的转化率，减少跳失率？产品视觉是提高转化的基础。\r\n电商广告费越来越高，硬广、钻展、直通车广告图等都是在比拼转化率。为什么同样一个位置每个广告的点击率会差数十倍呢？为什么同一个品牌的点击效果也不尽相同呢？因为营销视觉设计有着非常强的规律性，你的设计师是否找到了高点击率的规律呢？\r\n视觉营销方式的主要特点：\r\n1．无声语言：视觉营销主要通过色彩和造型来吸引顾客，用无声的语言来达到说服顾客购买目的，对于一些富有时尚主张、厌烦“盯人式”顾客其导购方式更具意义。\r\n2．直观的美感：视觉营销的形式直观，可以在第一时间打动顾客。如女装卖场将色彩分区作为划区的第一层分类法，一方面是就是突出服装的色彩和谐的美感，另一方面也考虑到直观的美感能更多地激起女性顾客的冲动购买愿望\r\n3．低成本：视觉营销主要通过改变卖场中货品的陈列和组合方式，使卖场中的货品组合更加科学，色彩更加协调。在不用添加更多成本的前题下，可以使卖场的面貌发生变化，和其他营销方式相比，成本更加节约。\r\n课程收益：\r\n1：建立完善的营销视觉标准体系，设计师的绩效考核及工单管理；\r\n2：产品描述页的规划原则，爆款的描述页的打造，通过数据来分析和调整产品描述设计，提升转化率、降低跳失率；关联营销设计与流量路径管理；\r\n3: 学习促销广告设计的要点与原则，如何通过数据分析来指导和改进促销广告的设计；\r\n培训对象：\r\n对店铺装修存在疑问想提升店铺装修能力，提升店铺转化率的学员！','0','1438743404','1446519404','1438743404','0','0','','1','1','2','视觉营销店铺美工专题 嘉兴市明德职业技能培训学校  学校颁发的结业证书 视觉00 营销00 店铺00 美工00 专题00 嘉兴00 明德00 职业00 技能00 培训00 学校00 颁发00 结业00 结业证0 证书00 IT000 浙江00 浙江省0 市网00 网店美工 老师00 如何00 做好00 品牌00 产品00 一个00 完整00 体系00 买家00 为何00 不住00 一定00 出现00 问题00 网上00 就是00 图片00 一样00 为什00 为什么0 什么00 销量00 首先00 考虑00 是不是0 不是00 描述00 通过00 策划00 提升00 形象00 提高00 转化00 转化率0 减少00 基础00 电商00 广告00 广告费0 越来越0 直通00 直通车0 通车00 比拼00 同样00 个位00 位置00 每个00 点击00 点击率0 同一00 同一个0 效果00 不尽00 相同00 因为00 视觉设计 设计00 有着00 非常00 规律00 规律性0 设计师0 是否00 找到00 高点00 方式00 主要00 特点00 无声00 语言00 色彩00 造型00 吸引00 顾客00 达到00 说服00 购买00 目的00 对于00 一些00 富有00 有时00 时尚00 主张00 厌烦00 盯人00 导购00 更具00 意义00 直观00 美感00 形式00 可以00 第一00 一时00 一时间0 时间00 打动00 女装00 卖场00 分区00 作为00 分类00 分类法0 一方00 一方面0 方面00 突出00 服装00 和谐00 更多00 激起00 女性00 冲动00 愿望00 成本00 改变00 变卖00 货品00 陈列00 组合00 更加00 科学00 协调00 不用00 添加00 可以使0 面貌00 发生00 生变00 变化00 其他00 相比00 节约00 课程00 收益00 建立00 完善00 标准00 标准体0 绩效00 考核00 单管00 管理00 规划00 原则00 打造00 过数00 数据00 分析00 调整00 降低00 关联00 联营00 流量00 路径00 学习0