INSERT INTO `qs_course` VALUES ('1357','0','69679','电商创意视频剪辑班','2','嘉兴市明德职业技能培训学校','129','11','IT培训','1880','随到随学','0','','12','216','浙江省/嘉兴市','了解计算机的基础应用，具备刻苦学习的意志，有一定审美能力，有自学能力，热爱视频剪辑事业，希望用自己的','学校颁发的结业证书','270','4980','0','我可以学么？\r\n掌握年薪6位数的剪辑技能，做电商时代追捧的剪辑大师！\r\n当今急速发展的科技影音时代，视频已经成为视觉表现的主要手段，视频广告也将成为广告及其他领域的重要发展趋势，广告领域的数字化人才是21世纪最匮乏的人才之一。\r\n电商创意视频剪辑正是立足于电商广告在数字化领域的专业影像制作课程，聘请广告领域的业内各个专家，为立志成为电商广告人的学员量身定做的实践体验式课程。\r\n剪辑是任何视频中都会运用到的，大多数初学者最开始接触到的也是剪辑，虽然剪辑的操作很简单，但是真正能够做出大师级别的却并不多。\r\n在剪辑的过程中，除去画面，还有声音、音乐、音效、字幕等组成视频的元素。想要把他们组合起来只需要掌握一款剪辑软件就可以了，可想要达到一定的商业水平则要配合恰当才行。\r\n“剪辑师其实就是一位‘高级裁缝师’，把各种不同的布块缝合在一起，成为一件艺术品，这里的布块则是声像、音乐、字幕各种视频里面需要的元素。”\r\n课程针对人群：\r\n已了解计算机的基础应用，具备刻苦学习的意志，有一定审美能力，有自学能力，热爱视频剪辑事业，希望用自己的双手创造出属于自己的视频特效作品或希望从事电商视频剪辑事业。\r\n培训课程主要讲授：\r\n制作环节中相关软件的使用，及当下的电商视频行业中的制作规范与流程。','0','1438744969','1446520969','1438744969','0','0','','1','1','1','电商创意视频剪辑班 嘉兴市明德职业技能培训学校  学校颁发的结业证书 电商00 创意00 视频00 视频剪辑 剪辑00 嘉兴00 明德00 职业00 技能00 培训00 学校00 颁发00 结业00 结业证0 证书00 IT000 浙江00 浙江省0 可以00 掌握00 年薪00 位数00 时代00 追捧00 大师00 当今00 急速00 发展00 科技00 影音00 已经00 成为00 视觉00 表现00 主要00 手段00 广告00 为广告0 及其00 及其他0 其他00 领域00 重要00 趋势00 数字00 数字化0 人才00 世纪00 匮乏00 之一00 正是00 立足00 专业00 影像00 制作00 课程00 聘请00 业内00 各个00 专家00 立志00 志成00 广告人0 学员00 定做00 实践00 体验00 任何00 运用00 用到00 大多00 大多数0 多数00 初学00 学者00 开始00 接触00 虽然00 操作00 简单00 但是00 真正00 能够00 做出00 大师级0 师级00 级别00 过程00 除去00 画面00 还有00 有声00 声音00 音乐00 音效00 字幕00 组成00 元素00 想要00 他们00 组合00 起来00 只需00 需要00 软件00 达到00 一定00 商业00 水平00 配合00 恰当00 剪辑师0 其实00 就是00 高级00 裁缝00 各种00 不同00 缝合00 一起00 艺术00 艺术品0 这里00 声像00 里面00 针对00 人群00 了解00 计算00 计算机0 基础00 应用00 具备00 刻苦00 苦学00 学习00 意志00 审美00 能力00 自学00 热爱00 事业00 希望00 自己00 双手00 创造00 属于00 特效00 作品00 从事00 讲授00 环节00 相关00 使用00 当下00 行业00 规范00 流程00','电商创意视频剪辑班,嘉兴市明德职业技能培训学校,,学校颁发的结业证书','','120.769908','30.772647','1','1','0');
