INSERT INTO `qs_course` VALUES ('1359','0','69597','高级二手车鉴定评估师资格证全年招生','2','昆山市携成教育咨询服务有限公司','4','16','汽车培训','1880','随到随学','0','','11','204','江苏省/苏州市','20周岁以上','','培训一个星期，两个月出证','0','0','二手车鉴定评估师证的作用（每批报名每月20号前结束）：\r\n国家规定，在4S店、二手车交易公司、典当公司、拍卖公司、资产评估机构从事二手车估价必须持证上岗。\r\n持证可专业从事具备法律效力的汽车鉴定评估工作，签署和开具鉴定评估报告书，并可收取相应的手续费。\r\n注册公司：注册成立二手车交易公司或评估机构时，必须有三名以上持有资格证书的评估师，工商局才予以审批注册公司。上述注册的公司在年检、核查时或者产生法律纠纷取证时，本职业资格书都可作为有效合法的证明和证据。\r\n报名资料：身份证扫描件，毕业证扫描件，1寸蓝底照片电子档。\r\n\r\n咨询电话：18112589331（微信同号）\r\n咨询QQ：2984029757','0','1438758694','1470294694','1441592396','0','0','','1','1','34','高级二手车鉴定评估师资格证全年招生 昆山市携成教育咨询服务有限公司  高级00 二手00 二手车0 鉴定00 评估00 评估师0 师资00 资格00 资格证0 全年00 招生00 昆山00 成教00 教育00 咨询00 服务00 有限00 公司00 汽车00 培训00 江苏00 江苏省0 苏州00 州市00 作用00 国家00 家规00 规定00 交易00 典当00 拍卖00 资产00 机构00 从事00 估价00 必须00 持证00 上岗00 专业00 具备00 法律00 效力00 工作00 签署00 开具00 报告00 报告书0 收取00 相应00 手续00 手续费0 注册00 成立00 以上00 持有00 证书00 工商00 工商局0 予以00 审批00 批注00 上述00 年检00 核查00 时或00 或者00 产生00 纠纷00 取证00 本职00 职业00 作为00 有效00 合法00 证明00 证据00 报名00 资料00 身份00 身份证0 扫描00 毕业00 毕业证0 照片00 电子00 电话00','高级二手车鉴定评估师资格证全年招生,昆山市携成教育咨询服务有限公司,,','','0.000000','0.000000','1','1','0');
INSERT INTO `qs_course` VALUES ('1360','8','69597','建设工程造价员招生 证书国家认可','2','昆山市携成教育咨询服务有限公司','4','21','土木工程','1880','随到随学','0','','11','204','江苏省/苏州市','18周岁以上','','1-3个月','0','0','为加强对全国建设工程造价员的管理，规范全国建设工程造价员的从业行为和提高其业务水平，中国建设工程造价管理协会制定并发布了《全国建设工程造价员管理暂行办法》(中价协[2006]013号)；全国建设工程造价员是指通过考试，取得《全国建设工程造价员资格证书》，从事工程造价业务的人员。\r\n\r\n 简介：\r\n   全国造价员统一是由中国建设工程造价管理协会监督管理，中国建设工程造价管理协会是不颁发证书的，授权给全国48家机构颁发造价员，其中31家是各省市，17家是行业的。全国的造价员统一一个版本，唯一的区别在鉴定章上。\r\n\r\n一、招生对象：\r\n中专及以上学历，工作满一年（20周岁以上）\r\n \r\n二、报名材料：\r\n 1、中专以上学历文本或电子版的扫描件\r\n 2、身份证文本或电子版的扫描件\r\n 3、照片，白底1寸6张或电子版需5寸\r\n 4、报名表文本、电子版各一份（文本需加盖公司章）\r\n \r\n三、授课形式：    \r\n    网上授课，学习方式灵活、时间自由。\r\n\r\n四、具体行业和专业\r\n    林业造价员（土建、安装、市政、装饰、园林）\r\n\r\n五、学习课 程：\r\n 1、《工程造价基础知识》        \r\n 2、《工程计量和计价实务》（分专业）    \r\n \r\n六、查询方式：\r\n中国建设工程造价管理协会查询（http://www.ceca.org.cn）\r\n \r\n七、出证周期：3-5个月\r\n\r\n八、联系方式\r\n1. 报名地址一：苏州市人民路1732号平江大厦308室\r\n   报名地址二：昆山市人民北路93号成泰商务广场7F 711室\r\n2. 网站：http://www.jsxcedu.com/','0','1438759130','1470295130','1441592379','0','0','','1','1','39','建设工程造价员招生 证书国家认可 昆山市携成教育咨询服务有限公司  建设00 工程00 工程造价 工程造价员 造价00 造价员0 招生00 证书00 国家00 认可00 昆山00 成教00 教育00 咨询00 服务00 有限00 公司00 土木00 木工00 江苏00 江苏省0 苏州00 州市00 加强00 全国00 管理00 规范00 从业00 业行00 行为00 提高00 业务00 水平00 中国00 协会00 制定00 并发00 发布00 暂行00 办法00 通过00 考试00 取得00 资格00 资格证0 从事00 人员00 简介00 统一00 是由00 由中国0 监督00 颁发00 发证00 授权00 机构00 其中00 各省00 省市00 行业00 一一00 一个00 版本00 唯一00 区别00 鉴定00 对象00 中专00 以上00 上学00 学历00 工作00 报名00 材料00 文本00 电子00 电子版0 扫描00 身份00 身份证0 照片00 白底00 名表00 加盖00 授课00 形式00 网上00 学习00 方式00 灵活00 时间00 自由00 具体00 专业00 林业00 土建00 安装00 市政00 装饰00 园林00 基础00 知识00 计量00 计价00 实务00 查询00 周期00 个月00 联系00 地址00 人民00 北路00 商务00 广场00 网站00','建设工程造价员招生 证书国家认可,昆山市携成教育咨询服务有限公司,,','','0.000000','0.000000','1','2','0');
