INSERT INTO `qs_course` VALUES ('1375','10','69690','武汉石锅拌饭系列培训及加盟','2','武汉一品香特色小吃培训','21','14','餐饮培训','1880','随到随学','0','','18','0','湖北省','不限','','50','3000','2800','无论是看韩剧还是韩国电影，总会出现男女主人公吃饭的场景，往往都离不了拌饭，看着五颜六色的拌饭，您是不是早已经垂涎三尺了。现在西餐厅、快餐厅都把拌饭作为主要经营品种。石锅拌饭是韩国特色的传统美食，韩国人民非常喜爱的家常饭之一，各地区的韩国人会就地取材，把当地的时蔬与米饭在石锅中加热后，在滋滋做响中，把营养和美味拌在一起，将饭菜和酱汁充分混合，香味随之升腾。拌饭在我国也历史悠久，以“全州拌饭”“晋州拌饭”最为有名。\r\n石锅拌饭培训内容 \r\n韩式辣酱制作 韩式辣白菜制作 风味凉拌菜制作 泡菜制作 叉烧肉制作 晋州桔梗拌饭 山菌土豆泥拌饭 全州南瓜拌饭 黑胡椒里脊肉拌饭 牛肉三丝拌饭 猪肉叉烧拌饭 麻辣鸡丝拌饭 鱿鱼拌饭 平壤石锅拌饭 乌冬面 拌面拌粉等\r\n培训时间\r\n老师一对一授课，包教包会,学会为止。不限制学习时间,一般7天左右，视个人情况而定。\r\n培训费用2800\r\n含技术转让费、中餐费、材料费、资料费、三年技术升级费等，中途不收任何费用。\r\n后续服务\r\n1.指导设备组合及采购信息。\r\n2.指导经营方法与销售技巧。\r\n3.终身免费技术升级。 \r\n拌饭的营养：拌饭里蕴涵着“五行五脏五色”的原理。菠菜、芹菜、小南瓜、黄瓜、银杏等五行属木，利于肝脏。生牛肉片、辣椒酱、红萝卜五行属火，利于心脏。凉粉、蛋黄、核桃、松子等黄色食品五行属土，利于脾脏。萝卜、黄豆芽、栗子、蛋白是白色食品，五行属金，利于肺脏。最后，桔梗、海带、香菇等五行属水，这些黑色食品利于肾脏。 \r\n培训名师，保证学员学习到最正宗的小吃饮品技术和受欢迎的口味！并全程指导您开店！ \r\n我们是一对一专业现场指导教学，随学随到。学习期间免费包吃包住,所有食材免费提供,一次性收费,没有其它任何费用，直到你完全学会为止,学校期间的吃住免费都在公司，在我培训中心学习的客户，远的客户来回可以报销路费。\r\n加盟费包括：商标品牌使用权，当地区域经营权，全套技术培训费及全套配方转让，及后期食材的提供。','0','1438825585','1470361585','1440751790','0','0','','1','1','26','武汉石锅拌饭系列培训及加盟 武汉一品香特色小吃培训  武汉00 系列00 培训00 加盟00 一品00 特色00 小吃00 餐饮00 湖北00 湖北省0 无论00 韩剧00 还是00 韩国00 国电00 电影00 总会00 出现00 男女00 女主人0 主人00 主人公0 吃饭00 场景00 往往00 不了00 看着00 是不是0 不是00 早已00 已经00 垂涎00 现在00 西餐00 西餐厅0 餐厅00 快餐00 作为00 为主00 主要00 经营00 品种00 传统00 美食00 国人00 人民00 非常00 喜爱00 家常00 之一00 各地00 地区00 就地00 取材00 当地00 米饭00 中加00 加热00 营养00 和美00 美味00 一起00 饭菜00 充分00 混合00 香味00 随之00 升腾00 我国00 历史00 悠久00 全州00 晋州00 最为00 有名00 内容00 韩式00 制作00 白菜00 风味00 凉拌00 泡菜00 肉制00 桔梗00 土豆00 南瓜00 黑胡椒0 胡椒00 牛肉00 猪肉00 麻辣00 鸡丝00 鱿鱼00 平壤00 时间00 老师00 一对一0 授课00 学会00 为止00 限制00 学习00 一般00 左右00 个人00 人情00 情况00 技术00 转让00 转让费0 中餐00 餐费00 材料00 材料费0 资料00 资料费0 升级00 中途00 任何00 费用00 后续00 服务00 指导00 设备00 组合00 采购00 信息00 经营方0 方法00 销售00 技巧00 终身00 免费00 蕴涵00 五行00 五脏00 五色00 原理00 菠菜00 芹菜00 黄瓜00 银杏00 利于00 肝脏00 肉片00 辣椒00 萝卜00 心脏00 凉粉00 蛋黄00 核桃00 黄色00 食品00 黄豆00 豆芽00 栗子00 蛋白00 白色00 最后00 海带00 香菇00 这些00 黑色00 肾脏00 名师00 保证00 学员00 正宗00 饮品00 欢迎00 口味00 全程00 开店00 我们00 专业00 现场0