INSERT INTO `qs_course` VALUES ('1376','10','69690','武汉兰州拉面培训','2','武汉一品香特色小吃培训','21','14','餐饮培训','1880','随到随学','0','','18','0','湖北省','不限','','50','1800','1600','拉面是西北城乡独具地方风味的面食名吃。拉面可以蒸、煮、烙、炸、炒，各有一番风味。拉面是甘肃省兰州的名产。拉面的技术性很强，要制好拉面必须掌握正确要领，即和面要防止脱水，晃条必须均匀，出条要均匀圆滚，下锅要撒开， 防止蹲锅疙瘩。拉面根据不同口味和喜好还可制成小拉条、空心拉面、夹馅拉面、龙须面、扁条拉面、水拉面等不同品种。\r\n   拉面仅需几千元资金，两个人就能经营，几天即可开业，投资小，收益快，基本上没有风险，当月投资，当月收益，不需要广告宣传，兰州拉面不需要豪华装修，店面选址广泛，可在商场、超市、步行街、学校、商铺档口、社区、集贸市场等地都可开店经营，也可无店经营。兰州拉面风味独特，能满足需男女老少各类消费群体，可早、中、晚、夜宵四次联动销售，一天24小时不间断赚钱，只需要勤勤恳恳的劳作，是真正的创业好项目.\r\n培训内容	兰州拉面、羊肉拉面、香辣拉面、麻辣拉面、清汤拉面、炸酱拉面、风味拌面、炒拉面等\r\n培训课程安排	1.讲述的兰州拉面发展史及基础理论知识。\r\n2.和面的技术与技巧.\r\n3.拉面的技术与技巧\r\n4.牛肉的卤制方法\r\n5.高汤的制作流程与方法\r\n6.拌面的制作方法与销售技巧。\r\n7.杂酱的制作流程和方法。','0','1438825684','1470361684','1440751706','0','0','','1','1','17','武汉兰州拉面培训 武汉一品香特色小吃培训  武汉00 兰州00 拉面00 培训00 一品00 特色00 小吃00 餐饮00 湖北00 湖北省0 西北00 北城00 城乡00 独具00 地方00 风味00 面食00 名吃00 可以00 一番00 甘肃00 甘肃省0 面的00 技术00 技术性0 必须00 掌握00 正确00 要领00 和面00 防止00 脱水00 均匀00 疙瘩00 根据00 不同00 口味00 喜好00 制成00 空心00 品种00 仅需00 几千00 资金00 两个00 个人00 经营00 即可00 开业00 投资00 投资小0 收益00 基本00 基本上0 没有00 风险00 当月00 需要00 广告00 宣传00 豪华00 装修00 店面00 选址00 广泛00 可在00 商场00 超市00 步行00 步行街0 学校00 商铺00 社区00 市场00 开店00 独特00 满足00 男女00 老少00 各类00 消费00 消费群0 群体00 夜宵00 联动00 销售00 小时00 间断00 赚钱00 只需00 勤勤00 勤恳00 劳作00 真正00 创业00 项目00 羊肉00 香辣00 麻辣00 清汤00 炸酱00 讲述00 发展00 发展史0 基础00 理论00 知识00 技巧00 牛肉00 方法00 高汤00 制作00 流程00 制作方0','武汉兰州拉面培训,武汉一品香特色小吃培训,,','','0.000000','0.000000','1','1','0');
INSERT INTO `qs_course` VALUES ('1377','10','69690','武汉凉菜，泡菜系列培训','2','武汉一品香特色小吃培训','21','14','餐饮培训','1880','随到随学','0','','18','0','湖北省','不限','','50','1800','1600','凉菜介绍\r\n   凉菜，顾名思义就是放凉着来吃的小菜。这与趁热品尝的概念不同，必须是放凉的或者从冰箱冷冻过的吃起来才更美味。凉拌的菜式本来不多，但随着外来菜系的不断补充，凉菜的品种也越发丰富了，爽口、味鲜、有营养，这让人们也渐渐喜欢上这些凉着吃的品种，尤其在夏天或者吃辣的时候，凉菜则更是饭桌上的宠儿。     凉拌菜是一种简便制作凉菜的方法，按菜的原料又可分为生拌、熟拌两种，主要都是通过刀工、调味而成。主要原料大部分是熟料，因此这与热菜烹调方法有着截然的区别，它的主要特点是：选料精细、口味干香、脆嫩、爽口不腻，色泽艳丽，造形整齐美观，拼摆和谐悦目。\r\n凉菜品种\r\n夫妻肺片●什锦拌菜●龙口粉丝●金钩西芹●蒜油藕片●红油肚丝●香菇蒜泥●盐水花生●秘制蒜泥白肉●怡红快绿●手撕茄子●凉拌豆芽海带●凉拌时蔬●凉拌玫瑰三丝●泡椒海带丝●香菜拌牛肉●老醋海蛰头●香椿拌豆腐●拌桔根●拌明太鱼●拌泥鳅等等\r\n学 费：1600元，包含技术转让费、中餐费、住宿费、学习材料费、资料费等，中途不收任何费用，三年以上免费技术升级。 \r\n学习时间：随到随学，5天左右，根据各人掌握情况而定，不限制学习时间，包教包会，学会为止。\r\n泡菜品种\r\n1.白云系列：●泡椒凤爪●白云猪尾●白云鸭掌●白云猪耳等\r\n2.四川泡菜：●什锦泡菜王●泡笋子●三色泡菜●滋补苦瓜泡菜●果味泡菜（甜）●橙汁冬瓜条●\r\n桂花大蒜●山楂蜜瓜●蜜汁马蹄●萝卜、豇豆、雪里红、青红辣椒等大众泡菜。\r\n3.韩式泡菜：●平壤辣白菜●泡黄瓜●泡萝卜条●小萝卜泡菜●朝鲜泡菜等●什锦系列等。\r\n\r\n\r\n\r\n培训要点\r\n\r\n 本系列详细传授韩式泡菜、西式泡菜、四川泡菜、加州泡菜的不同制作方法，口味地道爽口，是你开家泡菜馆的最佳选择。各种精美凉拌菜，款款美味，别致爽口。','0','1438825882','1470361882','1440751745','0','0','','1','1','9','武汉凉菜，泡菜系列培训 武汉一品香特色小吃培训  武汉00 凉菜00 泡菜00 菜系00 系列00 培训00 一品00 特色00 小吃00 餐饮00 湖北00 湖北省0 介绍00 思义00 就是00 小菜00 品尝00 概念00 不同00 必须00 或者00 冰箱00 冷冻00 起来00 美味00 凉拌00 本来00 随着00 外来00 不断00 补充00 品种00 越发00 丰富00 爽口00 营养00 人们00 渐渐00 喜欢00 这些00 尤其00 夏天00 时候00 更是00 饭桌00 桌上00 宠儿00 简便00 制作00 方法00 原料00 分为00 为生00 主要00 通过00 调味00 大部00 大部分0 部分00 熟料00 因此00 热菜00 烹调00 有着00 截然00 区别00 特点00 选料00 精细00 口味00 色泽00 艳丽00 造形00 整齐00 美观00 和谐00 悦目00 菜品00 夫妻00 什锦00 龙口00 粉丝00 西芹00 香菇00 蒜泥00 盐水00 水花00 花生00 怡红00 茄子00 豆芽00 海带00 玫瑰00 香菜00 牛肉00 香椿00 豆腐00 泥鳅00 等等00 包含00 技术00 转让00 转让费0 中餐00 餐费00 住宿00 住宿费0 学习00 材料00 材料费0 资料00 资料费0 中途00 任何00 费用00 以上00 免费00 升级00 时间00 左右00 根据00 各人00 掌握00 情况00 限制00 学会00 为止00 白云00 四川00 滋补00 苦瓜00 果味00 冬瓜00 桂花00 大蒜00 山楂00 马蹄00 萝卜00 豇豆00 青红00 辣椒00 大众00 韩式00 平壤00 白菜00 黄瓜00 朝鲜00 要点00 详细00 传授00 西式00 加州00 制作方0 地道00 菜馆00 最佳00 选择00 各种00 精美00 款款00 别致00','武汉凉菜，泡菜系列培训,武汉一品香特色小吃培训,,','','0.000000','0.000000','1','1','0');
INSERT INTO `qs_course` VALUES ('1381','0','69710','心理咨询师包过班','2','重庆市远景职业培训学校','131','27','其他资格培训','1883','周末班','0','','4','0','重庆市','医务工作者、教育工作者、高校高年级学生、企业人力资源管理人员、新闻工作者、企事业单位从事思想政治工作','全国统考心理咨询师职业资格证','200','0','0','基础心理学\r\n心理活动的生理基础，感、知觉，记忆，思维、言语及想像，意识与注意，需要与动机，情绪、情感和意志，人格等。\r\n发展心理学\r\n婴儿期的心理发展，幼儿期的心理发展，童年期的心理发展，青春期的心理发展，青年期的心理发展等。\r\n社会心理学\r\n社会化与自我，社会知觉与归因，社会动机与社交情绪，态度，沟通与人际关系，社会影响，爱情、婚姻与家庭。\r\n变态心理学与健康心理学理论\r\n正常心理与异常心理及其区分，常见异常心理的症状，常见精神障碍，心理健康与心理不健康，心理不健康状态的分类、压力与健康。\r\n心理测量理论\r\n测验的常模，测验的信度，测验的效度，项目分析，测验编制的一般程序，心理测验的使用\r\n心理测验技能\r\n智力测验（韦氏成人智力测验、联合型瑞文测验），人格测验（明尼苏达个性调查表、卡氏16种人格因素测验），心理与行为问题评估（90项症状清单、抑郁自评量表）\r\n咨询心理学知识\r\n心理咨询的对象、任务、分类和一般程序，不同年龄阶段的心理咨询。如何建立咨关系，制定个体心理咨询方案，个体心理咨询方案的实施等\r\n心理咨询技能\r\n建立咨询关系、制定个体心理咨询方案、个体心理咨询方案的实施，团体心理咨询\r\n心理诊断技能\r\n初诊接待与资料的收集、整理，心理与行为问题评估，应激及相关问题评估，特殊心理评估的实施、初步诊断（CCMD-3，DSM-4-TR，ICD-10）。\r\n心理咨询实践活动\r\n走进社区、走进精神病院、走进学校、走进机关团体\r\n \r\n \r\n三、培训时间和收费标准\r\n \r\n \r\n培训\r\n学费\r\n备 注\r\n证书\r\n认证班\r\n1500元\r\n仅限相关专业学员，通过自学+核心考前复习串讲，以获取证书为目标\r\n《心理咨询师》职业资格证书\r\n \r\n面授班\r\n3000元\r\n适合于想全面系统学习的学员，全面学习与相关知识与技能，为以后的专业发展打下坚实的基础\r\n双证班\r\n 	\r\n适合于想全面系统学习心理咨询师和婚姻家庭师的学员。\r\n《婚姻家庭咨询师》职业资格证书\r\n全能班\r\n6000元\r\n适合想掌握心理咨询的实践技术，从事心理咨询相关工作，促进自我成长的学员，专家指导，为以后的事业发展提供实践督导平台\r\n《心理督导》证书','1437753600','1438839498','1444023498','1438839498','0','0','','1','1','1','心理咨询师包过班 重庆市远景职业培训学校  全国统考心理咨询师职业资格证 心理00 心理咨询师 咨询00 咨询师0 重庆00 远景00 职业00 培训00 学校00 全国00 统考00 师职00 资格00 资格证0 其他00 基础00 心理学0 理学00 活动00 生理00 知觉00 记忆00 思维00 言语00 想像00 意识00 注意00 需要00 动机00 情绪00 情感00 意志00 人格00 发展00 婴儿00 婴儿期0 理发00 幼儿00 幼儿期0 童年00 年期00 青春00 青春期0 青年00 社会00 会心00 社会化0 自我00 归因00 社交00 交情00 态度00 沟通00 人际00 关系00 影响00 爱情00 婚姻00 家庭00 变态00 健康00 学理00 理论00 正常00 异常00 及其00 区分00 常见00 症状00 精神00 障碍00 状态00 分类00 压力00 测量00 测验00 项目00 分析00 编制00 一般00 程序00 使用00 技能00 智力00 成人00 联合00 瑞文00 明尼00 个性00 调查00 调查表0 因素00 行为00 问题00 评估00 抑郁00 知识00 对象00 任务00 类和00 不同00 同年00 年龄00 阶段00 如何00 建立00 制定00 个体00 方案00 实施00 团体00 诊断00 接待00 资料00 收集00 整理00 应激00 相关00 特殊00 初步00 实践00 走进00 社区00 精神病0 病院00 机关00 机关团0 时间00 收费00 标准00 学费00 证书00 