INSERT INTO `qs_course` VALUES ('1382','0','69710','中医小儿推拿学习考证包考过','2','重庆市远景职业培训学校','131','20','其他技能培训','1884','全日制','0','','4','0','重庆市','年满18岁，喜欢从事母婴工作，大众人士均可','保健按摩师职业资格证和中医小儿推拿职业技能证','30天','0','0','远离抗生素，用爱手护――\r\n中医小儿推拿\r\n我们在寻找：\r\n有没有一种方法，可以让孩子强身健体、尽可能不生病或者少生病；\r\n有没有一种方法，可以让生病的孩子少打针吃药，尽快好起来；\r\n有没有一种方法，可以帮助家长面对生病的孩子不再茫然无措；\r\n有没有一种方法，可以给妈妈信心、力量、能力，把健康带给孩子。\r\n远景学校提供最具价值的儿童防病、治病方法。早一天学习并运用让孩子早受益！\r\n    小儿推拿是建立在祖国医学整体观念的基础上，以阴阳五行、脏腑经络等学说为理论指导，运用各种手法刺激穴位，使经络通畅、气血流通，以达到调整脏腑功能、治病保健目的的一种方法。\r\n小儿推拿的治疗体系形成于明代，以《保婴神术按摩经》等小儿推拿专著的问世为标志。小儿推拿的穴位有点状穴、线状穴、面状穴等，在操作方法上强调轻快柔和、平稳着实，注重补泻手法和操作程序，对常见病、多发病均有较好疗效，对消化道病症疗效尤佳。\r\n小儿推拿的治疗法则与内治法基本一样，谨守病机，以期治病求本，调整阴阳，扶正祛邪。在中医基础理论的指导下，广泛应用于小儿泄泻、呕吐、食积、厌食、便秘、腹痛、脱肛、感冒、咳嗽、哮喘、发热、遗尿、夜啼、肌性斜颈、落枕、惊风等疾病，有较好的效果。\r\n一、中医小儿推拿优势\r\n1、绿色疗法，不必打针吃药，没有毒、副作用，安全、方便、易行、疗效显著。\r\n2、不受设备、医疗条件的限制\r\n3、患儿可免除打针服药之痛苦                       \r\n4、增加父母与子女之亲情\r\n5、治疗保健的一个颇具特色的常规疗法  \r\n二、小儿推拿治疗作用\r\n中医：调整阴阳、扶正祛邪、疏通经络\r\n西医：物理性刺激、提高小儿机体免疫力、促进消化等','1441555200','1438840019','1444024019','1439086826','0','0','','1','1','2','中医小儿推拿学习考证包考过 重庆市远景职业培训学校  保健按摩师职业资格证和中医小儿推拿职业技能证 中医00 小儿00 推拿00 学习00 考证00 过重00 重庆00 远景00 职业00 培训00 学校00 保健00 按摩00 按摩师0 师职00 资格00 资格证0 技能00 其他00 远离00 抗生00 抗生素0 我们00 寻找00 有没有0 没有00 方法00 可以00 孩子00 强身00 健体00 尽可能0 可能00 生病00 或者00 打针00 吃药00 尽快00 起来00 帮助00 家长00 面对00 对生00 不再00 茫然00 妈妈00 信心00 力量00 能力00 健康00 带给00 提供00 价值00 儿童00 防病00 治病00 运用00 受益00 建立00 祖国00 国医00 医学00 整体00 整体观0 观念00 基础00 阴阳00 五行00 脏腑00 经络00 学说00 理论00 指导00 各种00 手法00 刺激00 穴位00 通畅00 气血00 血流00 流通00 达到00 调整00 功能00 目的00 的的00 治疗00 体系00 形成00 于明00 明代00 专著00 问世00 标志00 有点00 点状00 操作00 强调00 轻快00 柔和00 平稳00 着实00 注重00 程序00 常见00 常见病0 多发00 多发病0 发病00 疗效00 对消00 消化00 病症00 治疗法0 疗法00 法则00 治法00 法基00 基本00 一样00 以期00 扶正00 广泛00 应用00 用于00 呕吐00 便秘00 腹痛00 脱肛00 感冒00 咳嗽00 哮喘00 发热00 遗尿00 落枕00 疾病00 效果00 优势00 绿色00 不必00 有毒00 副作用0 作用00 安全00 方便00 易行00 显著00 设备00 医疗00 条件00 限制00 患儿00 免除00 服药00 痛苦00 增加00 父母00 子女00 亲情00 一个00 颇具00 特色00 常规00 疏通00 西医00 物理00 理性00 提高00 高小00 机体00 免疫00 免疫力0 促进00','中医小儿推拿学习考证包考过,重庆市远景职业培训学校,,保健按摩师职业资格证和中医小儿推拿职业技