INSERT INTO `qs_course` VALUES ('1383','0','69659','湖州专用培训叉车','2','湖州浦华培训学校','58','10','技工','1880','随到随学','0','','12','0','浙江省','在校学生 在职人员 农民工','叉车证','15','0','0','17周岁以上，初中以上学历，身体健康，待业或在职人员。叉车培训内容：叉车的工作原理结构；内燃叉车及电瓶叉车安全技术；车辆稳定性和安全操作；叉车日常维护及故障排除；叉车的一、二、三级保养；机动车辆的防火技术；规范驾驶操作：启动、起步、行车、运行、倒车、转向、搬运、装卸、各项堆垛作业规程；厂内运输驾驶员身心健康与安全；厂内运输常见事故的原因分析和预防；仓库管理：流程优化、库存控制、软件应用。费用：1400元/ 学期\r\n   电工培训内容：安全技术基础知识与急救；认识常用工具及材料；电气识图；安装电工操作技能；电机与变压器的使用与维修；常用低压电器与典型控制线路的安装与维修；三相异步电动机控制线路的安装和检修；电子元器件的识别与测试；电工仪器仪表的使用与维护；变压器和电焊机的使用与维修；电动机和特种电机的使用与维修；电动机复杂控制电路的安装与维修；一般机械设备电气控制电路的检修；可编程序控制器应用技术；企业内供电系统的操作与维护 费用：低压1200元/学期 高压1500元/学期 高低压2000元/学期\r\n   焊工培训内容:学习识图、预算、下料、金属材料焊接、切割；规范的使用各种焊接切割工具。手工电弧焊、埋弧焊、 CO2气体保护焊、手工钨极氩弧焊、平焊、立焊、横焊、仰焊、不锈钢焊、铝焊、铜焊、银焊、铸铁缸体 冷焊、铸铁缸体气焊、压力容器焊、焊接缺陷和检验方法、焊接安全知识、常用钢材及其焊接安全生产 操做，常用设备维护与保养。 费用：1800元/学期 \r\n   挖掘机培训：16岁以上，初中学历，身体健康，待业或在职人员。培训内容：熟练掌握两个操作杆，八个动作的运用，如挖掘机的挖土，甩土、倒土、整平挖楼基、亲自装翻斗车、修破、行走、爬坡、破碎锤、加长臂、挖河清淤及各种车辆的保养与维修培训费用：4800元/学期。 报名请携带：2寸蓝底彩照五张，身份证复印件两张，初中毕业证书一份\r\n     三人以上团体价.','0','1438844502','1525158102','1441414126','0','0','','1','1','1','湖州专用培训叉车 湖州浦华培训学校  叉车证0 湖州00 专用00 培训00 叉车00 学校00 技工00 浙江00 浙江省0 周岁00 以上00 初中00 上学00 学历00 身体00 健康00 待业00 在职00 人员00 内容00 工作00 原理00 结构00 内燃00 及电00 电瓶00 安全00 技术00 车辆00 稳定00 稳定性0 定性00 操作00 日常00 维护00 故障00 排除00 三级00 保养00 机动00 机动车0 动车00 防火00 规范00 驾驶00 启动00 起步00 行车00 运行00 倒车00 转向00 搬运00 装卸00 各项00 作业00 规程00 运输00 驾驶员0 身心00 常见00 事故00 原因00 分析00 预防00 仓库00 仓库管理 库管00 管理00 流程00 优化00 库存00 控制00 软件00 应用00 学期00 电工00 基础00 知识00 急救00 认识00 常用00 用工00 工具00 材料00 电气00 安装00 安装电工 技能00 电机00 变压00 变压器0 使用00 维修00 低压00 压电00 电器00 典型00 控制线0 线路00 三相00 相异00 异步00 电动00 电动机0 动机00 检修00 电子00 元器件0 器件00 识别00 测试00 仪器00 仪表00 电焊00 电焊机0 焊机00 特种00 复杂00 电路00 一般00 机械00 设备00 可编00 可编程0 编程00 程序00 控制器0 企业00 业内00 供电00 系统00 焊工00 学习00 预算00 金属00 焊接00 切割00 各种00 手工00 气体00 保护00 不锈00 不锈钢0 铸铁00 缸体00 压力00 容器00 缺陷00 检验00 验方00 方法00 钢材00 及其00 全生00 生产00 设备维护 挖掘00 挖掘机0 中学00 熟练00 掌握00 两个00 动作00 运用00 挖土00 亲自00 翻斗车0 行走00 破碎00 加长00 报名00 携带00 彩照00 身份00 身份证0 复印00 复印件0 毕业00 毕业证0 证书00 团体00','湖州专用培训叉车,湖州浦华培训学校,,叉车证