INSERT INTO `qs_course` VALUES ('1384','0','69633','天桥区北园大街佰科教育专业学会计','2','佰科教育','19','23','会计资格证','1880','随到随学','0','','16','261','山东省/济南市','想从事会计工作的人员','会计从业资格证','102','0','0','会计全科：\r\n学习会计基础、财务会计、初级电算化、&#8203;&#8204;&#8204;会计实务操作、会计从业资格证考前辅导(会计基础、职业道德和财经法规)，学会可持双证上岗(会计从业资格证和电算化上岗证)，是走上会计之路的完美组合;适合无基础者学习。\r\n会计证考前辅导班：\r\n包括会计基础、财经法规和职业道德两门指定科目，电化教学，紧扣考试大纲，讲练结合，易学易懂，适合有会计基础的人员学习。会计全科：\r\n学习会计基础、财务会计、初级电算化、会计实务操作、会计从业资格证考前辅导(会计基础、职业道德和财经法规)，学会可持双证上岗(会计从业资格证和电算化上岗证)，是走上会计之路的完美组合;适合无基础者学习。\r\n会计证考前辅导班：\r\n包括会计基础、财经法规和职业道德两门指定科目，电化教学，紧扣考试大纲，讲练结合，易学易懂，适合有会计基础的人员学习。会计全科：\r\n学习会计基础、财务会计、初级电算化、会计实务操作、会计从业资格证考前辅导(会计基础、职业道德和财经法规)，学会可持双证上岗(会计从业资格证和电算化上岗证)，是走上会计之路的完美组合;适合无基础者学习。\r\n会计证考前辅导班：\r\n包括会计基础、财经法规和职业道德两门指定科目，电化教学，紧扣考试大纲，讲练结合，易学易懂，适合有会计基础的人员学习。','0','1438852743','1464772743','1438852743','0','0','','1','1','1','天桥区北园大街佰科教育专业学会计 佰科教育  会计从业资格证 天桥00 大街00 科教00 教育00 专业00 学会00 会计00 教育会0 从业00 资格00 资格证0 山东00 山东省0 济南00 济南市0 南市00 全科00 学习00 学习会0 基础00 财务00 财务会计 初级00 电算00 电算化0 实务00 操作00 考前00 辅导00 职业00 道德00 财经00 法规00 上岗00 上岗证0 走上00 完美00 组合00 适合00 会计证0 辅导班0 包括00 指定00 科目00 电化00 教学00 紧扣00 考试00 大纲00 结合00 易学00 易懂00 人员00','天桥区北园大街佰科教育专业学会计,佰科教育,,会计从业资格证','','0.000000','0.000000','1','2','0');
INSERT INTO `qs_course` VALUES ('1385','0','69633','天桥区三孔桥嘉汇环球广场佰科会计培训特价优惠中','2','佰科教育','19','23','会计资格证','1880','随到随学','0','','16','261','山东省/济南市','想从事会计工作的人员','会计从业资格证','102','0','0','计从业资格证是进入会计职业领域的“门槛”，在我国所&#8203;&#8204;&#8204;有要从事会计行业的人员，必须持有会计从业资格证书（俗称会计证）。报考会计初级职称（助理会计师）、中级职称（会计师）和高级职称（高级会计师）必须以取得会计从业资格证为前提。会计从业资格考试是根据国家法律、法规进行的，无论在哪里通过培训和考试合法取得的会计从业资格证在全国范围内有效。\r\n一、济南最棒会计培训师资，\r\n只有熟悉考试才能通过考试，济南佰科会计课程由多年授课经验，熟悉考试大纲与教材重难点，对会计资格考试潜心研究数年的讲师组成，押题率高，学习效果好！花钱都请不来的好老师，全心全意助你通过考试！\r\n二、上课班次\r\n开设班级：上午班、下午班、晚班、双休日班，可自由选择班次学习。\r\n三、开设课程\r\n会计证综合班\r\n培训内容：按财政厅指定教材授课，山东省财政厅统一考试，证书全国承认。从零学起，学习考试科目：《会计基础》、《财经法规与职业道德》、《会计电算化》，教你如何设置科目帐户，登记账薄，编制审核记帐，最新会计准则与会计法规等。学费：680元\r\n会计实务操作班（手把手做账）\r\n适合有会计证，有理论基础而无实践经验，想独立上岗的人员。主要学习一般纳税人的帐目处理方法；小规模纳税人的帐目处理方法；服务性行业的帐目处理方法；系统规范学习现金支票、银行支票、进账单等票据的填写、应用；建帐、填写凭证、记帐、编制财务报表。讲授最新国税、地税申报政策。学习网上报税等。学会为止。让你迅速掌握纳税技巧，轻松做会计。学费：680元\r\n会计初级职称（助理会计师）\r\n培训内容：《初级会计实务》和《经济法基础》精讲、串讲、考前强化、紧扣大纲） 学费：599元\r\n会计中级职称（会计师）\r\n培训内容:《中级会计实务》,《财务管理》和《经济法基础》精讲、串讲、考前强化、紧扣大纲）','0','1438852795','1464772795','1438852795','0','0','','1','1','1','天桥区三孔桥嘉汇环球广场佰科会计培训特价优惠中 佰科教育  会计从业资格证 天桥00 环球00 广场00 会计00 培训00 特价00 优惠00 惠中00 科教00 教育00 教育会0 从业00 资格00 资格证0 山东00 山东省0 济南00 济南市0 南市00 进入00 入会00 职业00 领域00 门槛00 我国00 从事00 行业00 人员00 必须00 持有00 证书00 俗称00 会计证0 报考00 初级00 职称00 助理00 助理会计 理会00 会计师0 中级00 高级00 高级会计 高级会计师 取得00 前提00 考试00 根据00 国家00 家法00 法律00 法规00 进行00 无论00 哪里00 通过00 合法00 全国00 范围00 有效00 培训师0 师资00 只有00 熟悉00 才能00 会计课0 课程00 多年00 授课00 经验00 大纲00 教材00 重难点0 难点00 潜心00 研究00 讲师00 组成00 学习00 效果00 花钱00 老师00 上课00 班次00 开设00 班级00 上午00 下午00 晚班00 双休00 双休日0 自由00 选择00 综合00 内容00 财政00 财政厅0 指定00 统一00 承认00 科目00 基础00 财经00 道德00 电算00 电算化0 如何00 设置00 帐户00 登记00 记账00 编制00 审核00 记帐00 最新00 新会00 准则00 与会00 会计法0 实务00 操作00 手把00 手把手0 把手00 适合00 有理00 理论00 实践00 独立00 上岗00 主要00 一般00 纳税00 纳税人0 帐目00 处理00 方法00 小规00 小规模0 规模00 服务00 服务性0 性行00 系统00 规范00 现金00 支票00 银行00 进账00 账单00 票据00 填写00 应用00 建帐00 凭证00 财务00 报表00 讲授00 国税00 地税00 申报00 政策00 学习网0 网上00 上报00 报税00 学会00 为止00 迅速00 掌握00 技巧00 轻松00 经济00 经济法0 法基00 精讲00 串讲00 考前00 强化00 紧扣00