INSERT INTO `qs_course` VALUES ('1386','0','69699','郑州景观设计培训班哪里好','2','郑州景尚景观设计有限公司','89','20','其他技能培训','1881','白天班','0','','17','278','河南省/郑州市','大学生以及景观设计爱好者','','3个月','6000','5300','郑州景观设计培训班哪里好\r\n郑州景观设计培训 郑州景观设计培训哪里好 郑州景观设计师培训   郑州景观软件培训\r\n\r\n郑州培训班的培训地点就如同郑州分区一样，分几大块-北环、西郊、南区、郑东新区，郑东新区的一个培训班是为广大莘莘学子而创办的------郑州景尚景观设计培训班\r\n     这个培训班没有华丽的语言、没有奢侈的资金，他们只为广大学生和景观爱好者提供一个学习景观方面知识的一个平台。创始人不求挣多少钱，只有一颗服务的心。\r\n     对学生的服务\r\n   对于学生他们深深知道上学的心酸和经济带来的苦恼，为了减轻大学生的压力，制定了一系列的优惠政策，对于贫困的学生采取课打折的优惠和分期付款的待遇，享受所有优惠待遇。\r\n      对毕业1-2年的学生服务\r\n     制定了分期付款的业务，让刚出大学门的学生，有技术去支持他们的工作，以信誉的形式来帮助他们找到合适自己的工作。\r\n      培训班的实力\r\n这里没有很牛逼的大师、没有神一般的大咖，他们只有工作多年并经验丰富的主创设计师，设计师分两个部分，一个是景观设计师，村外景观事务所的创始人，另一个是室内设计师，来自天津的东易日盛的主创设计师。\r\n      他们的师资力量\r\n小梅：景观设计师，大小有过百的设计项目和设计，主讲设计方案施工图，设计师理论课。\r\n小学：室内设计师，经过好多现场设计与施工，主讲方案和施工图，设计师理论课，施工工艺等。\r\n小峰：效果图设计师，助教3d效果图，后期出图。\r\n小井：项目施工，助教实操施工理论课。\r\n魏老师：素质交际培养，软件设计。\r\n郭老师：软件设计，施工图基础。\r\n他们相信一句话：“皇经百战穿金甲，不破楼兰终不还”。加油吧热爱设计的骚年们。让我们一起冲吧。\r\n&#8203;','0','1438869915','1441461915','1438869915','0','0','','1','1','8','郑州景观设计培训班哪里好 郑州景尚景观设计有限公司  郑州00 景观00 景观设计 设计00 培训00 培训班0 哪里00 有限00 公司00 其他00 技能00 河南00 河南省0 郑州市0 州市00 景观设计师 设计师0 师培00 软件00 地点00 如同00 分区00 一样00 大块00 西郊00 南区00 郑东00 新区00 一个00 广大00 学子00 创办00 这个00 没有00 华丽00 语言00 奢侈00 资金00 他们00 大学00 大学生0 学生00 爱好00 爱好者0 好者00 提供00 学习00 方面00 知识00 平台00 创始00 创始人0 多少00 只有00 服务00 对于00 深深00 深知00 知道00 道上00 上学00 心酸00 经济00 经济带0 带来00 苦恼00 为了00 减轻00 压力00 制定00 系列00 优惠00 政策00 贫困00 采取00 打折00 分期00 付款00 待遇00 享受00 所有00 毕业00 业务00 技术00 支持00 工作00 信誉00 形式00 帮助00 找到00 合适00 自己00 实力00 这里00 大师00 有神00 一般00 般的00 多年00 经验00 丰富00 主创00 主创设计师 创设00 两个00 个部00 部分00 外景00 事务00 事务所0 室内00 室内设计 室内设计师 内设00 来自00 天津00 东易00 日盛00 师资00 资力00 力量00 小梅00 大小00 项目00 主讲00 设计方0 方案00 施工00 施工图0 理论00 理论课0 小学00 经过00 现场00 工艺00 效果00 效果图0 效果图设计 助教00 后期00 出图00 老师00 素质00 交际00 培养00 郭老00 基础00 相信00 一句话0 金甲00 不破00 楼兰00 加油00 热爱00 我们00 一起00','郑州景观设计培训班哪里好,郑州景尚景观设计有限公司,,','','113.779843','34.788224','1','1','0');
INSERT INTO `qs_course` VALUES ('1500','0','69723','卷馍培训','2','商丘梁三卷馍制作有限公司','53','14','餐饮培训','1880','随到随学','0','','17','291','河南省/商丘市','打工族 大学生 家庭主妇 待业人员 退伍军人 创业人员','商丘特色美食奖','24','0','0','梁三卷馍就是两张米皮儿叠在一起，在上面放入在鲜汤里煮熟的面筋、绿豆芽、鸡蛋，用手卷成圆锥形，因为卷馍叠成的是锥形，尖的那头里面没有菜，尖的那头在锅里沾一点红油，第一口吃下来也比较香。里面的面筋、豆芽越吃越多，真是价廉物美、营养丰富，梁三卷馍是地地道道的懒人食品。\r\n梁三卷馍以个大馅多出名，样子嘛和阜阳卷馍差不多，根据季节不同还会有荆芥（这个也是很有特色的香料）和香菜。在商丘最出名的卷馍应该属梁三卷馍。可以根据顾客自选加入鸡蛋、香肠、辣椒酱、香菜、蒜黄，一起卷入馍皮中。\r\n 大口咬下去，软嫩的馍皮，清爽的豆芽菜，筋道的面筋，加上鸡蛋或辣椒酱，独特的味道这就是梁三卷馍！\r\n\r\n梁三卷馍作为2015年最火爆的创业项目。\r\n\r\n独自一人就可以经营 \r\n\r\n简单易学，操作轻松。投资少，回报高。人人都能做老板的行业。\r\n\r\n\r\n赚钱理由1:独特造型、亮丽外观、引人注目、灵活经营。随买随走，老少皆宜。\r\n赚钱理由2:无需经验、轻松掌握、无需雇人、店店火爆、经营成本会更低!\r\n赚钱理由3:超级美味、经济实惠、现做现卖、天天排队好生意! 成功创业,绝佳选择,千载难逢,无论你抢或者不抢,梁三卷馍赚钱从未停止。不怕学问浅，就怕志气短。”没有知识不可怕，可怕的是没有志气。\r\n\r\n现如今，餐饮业成就了无数的富翁。这一次，你还能错过吗？梁三卷馍由于操作简单、口味好、独特、新奇、投资小、利润高、回本快，以小博大，倍增获利。\r\n无需厨师，自己做老板  大大节省不必要的开支！开店面、摆摊位、3~5平就可开业。省钱省到底。真正做到小本创业，白手起家。\r\n               郑重承诺\r\n　一路扶持，直至成功 　 经营支持―培训支持―升级支持―协助选址，抢先一步，先富十年。慧眼识珠的朋友们：如果有创业当老板的心愿，如果您还有什么理想和抱负，最明智和唯一的选择，就是加盟梁三卷馍“最珍贵的财富是时间，最大的浪费是虚度流年。”与其碌碌无为的安逸，还不如轰轰烈烈的闯一次。\r\n\r\n电话13523804350  QQ516374313','0','1439360096','1441952096','1439360096','0','0','','1','1','8','卷馍培训 商丘梁三卷馍制作有限公司  商丘特色美食奖 培训00 商丘00 制作00 有限00 公司00 特色00 美食00 餐饮00 河南00 河南省0 就是00 一起00 上面00 放入00 绿豆00 豆芽00 鸡蛋00 圆锥00 圆锥形0 因为00 头里00 里面00 没有00 一点00 第一00 口吃00 下来00 比较00 面的00 真是00 价廉00 物美00 营养00 丰富00 地道00 道道00 懒人00 食品00 出名00 样子00 阜阳00 差不多0 根据00 季节00 不同00 这个00 有特色0 香料00 香菜00 应该00 可以00 顾客00 自选00 加入00 香肠00 辣椒00 卷入00 下去00 清爽00 加上00 独特00 味道00 独自00 经营00 简单00 易学00 操作00 轻松00 投资00 回报00 人人00 老板00 行业00 赚钱00 理由00 造型00 亮丽00 外观00 注目00 灵活00 老少00 无需00 经验00 掌握00 雇人00 火爆00 成本00 本会00 超级00 美味00 经济00 实惠00 天天00 排队00 好生00 生意00 成功00 创业00 绝佳00 选择00 无论00 或者00 从未00 停止00 不怕00 学问00 志气00 气短00 有知00 知识00 不可00 可怕00 有志00 现如今0 如今00 餐饮业0 成就00 无数00 富翁00 一次00 错过00 由于00 口味00 新奇00 投资小0 利润00 博大00 倍增00 获利00 厨师00 自己00 大大00 大节00 节省00 不必00 必要00 开支00 开店00 店面00 摆摊00 摊位00 开业00 省钱00 到底00 真正00 做到00 白手00 起家00 郑重00 承诺00 扶持00 直至00 支持00 升级00 协助00 选址00 抢先00 先富00 慧眼00 朋友00 如果00 心愿00 还有0