INSERT INTO `qs_course` VALUES ('1399','0','69663','扬州建筑培训|造价员考试报名时间2015','2','扬州方通教育信息咨询有限公司','60','21','土木工程','1880','随到随学','0','','11','209','江苏省/扬州市','全体学员','造价员','100','0','0','一、造价员专业就业前景很好：\r\n1、从2010年的热门专业排行来看，她已排在第十一位。她作为试点专业最早于1999年开始招生，随着我国经济的发展，基本建设项目大量开发，这不是一朝一夕的事情，尤其在市场经济的今天，工程造价在基本建设项目相关工作中地位尤为突出，在项目开发的不同阶段均要细细的算好帐。如项目估算、概算、预算、结算等。\r\n2、工程造价专业在建设领域就业岗位分布较为广泛，政府审计、房地产开发、施工企业、造价咨询企业、监理企业、项目管理企业、招标代理企业等等，均有适合的岗位。\r\n二、本专业文理兼收，且适合女生就业；\r\n在一定工作经验基础上，从事工程造价工作基本上属于室内工作。本项工作要求耐心、细致；而这正是女生的优点。\r\n三、工程造价专业对学历要求不是很高，我接触的从事本行业的人中，学历最低的刚初中毕业。当然，学历越高能够更有利于熟悉造价原理，能够更好的适应造价工程的各种挑战。\r\n\r\n并且这几年工程造价发展不错，提倡全过程造价管理，从项目论证一直到项目决算都需要。并且年限越长越吃香，学成后，造价人员待遇较高，工作年限较长，是一门非常有发展潜力的专业技术。\r\n\r\n扬州土建造价员培训 扬州土建预算培训\r\n扬州安装造价员培训 扬州安装预算培训\r\n扬州市政造价员培训 扬州市政预算培训\r\n扬州方通教育\r\n\r\n【培训宗旨】\r\n通过培训，使学员能顺利通过年度造价员资格考试，并能熟练掌握国家的法律法规及有关工程造价的管理规定；能正确编制和审核施工图预算，参加工程的招投标工作。\r\n【考试设置】\r\n建设工程造价员考试分土建、安装、市政、装饰4个专业，初级、中级、高级3个等级。每名考生只能报考一个专业。\r\n考试设《工程造价基础知识》和《工程计量与计价实务》2个科目。《工程造价基础知识》为闭卷考试，《工程计量与计价实务》为开卷考试。\r\n\r\n\r\n具体时间以当年考试通知为准，详情联系：朱老师','0','1438944085','1525257685','1438944085','0','0','','1','1','8','扬州建筑培训|造价员考试报名时间2015 扬州方通教育信息咨询有限公司  造价员0 扬州00 建筑00 培训00 州市00 造价00 专业00 就业00 前景00 十一00 作为00 试点00 最早00 年开始0 开始00 招生00 随着00 我国00 经济00 发展00 基本00 建设00 项目00 大量00 开发00 这不00 不是00 一朝00 事情00 尤其00 市场00 今天00 工程00 工程造价 相关00 工作00 中地00 地位00 尤为00 突出00 不同00 阶段00 细细00 细细的0 估算00 概算00 预算00 结算00 在建00 领域00 岗位00 分布00 较为00 广泛00 政府00 审计00 房地00 房地产0 地产00 施工00 企业00 咨询00 监理00 项目管理 管理00 招标00 代理00 等等00 适合00 业文00 文理00 兼收00 女生00 生就00 生就业0 一定00 经验00 基础00 从事00 基本上0 属于00 室内00 本项00 要求00 耐心00 细致00 正是00 优点00 学历00 接触00 本行00 行业00 人中00 最低00 初中00 毕业00 当然00 高能00 能够00 有利00 有利于0 利于00 熟悉00 原理00 更好00 适应00 各种00 挑战00 并且00 不错00 提倡00 全过程0 过程00 论证00 一直00 直到00 决算00 需要00 年限00 吃香00 学成00 人员00 待遇00 非常00 常有00 潜力00 技术00 土建00 土建造价员 建造00 土建预算 安装00 安装造价员 安装预算 市政00 教育00 宗旨00 通过00 学员00 顺利00 过年00 年度00 资格00 考试00 熟练00 掌握00 国家00 法律00 法规00 有关00 规定00 正确00 编制00 审核00 施工图0 参加00 加工00 招投标0 投标00 设置00 工程造价员 员考试0 装饰00 初级00 中级00 高级00 等级00 考生00 只能00 报考00 一个00 知识00 计量00 计价00 