INSERT INTO `qs_course` VALUES ('1400','0','69663','扬州大学成人教育招生','2','扬州方通教育信息咨询有限公司','60','29','函授','1880','随到随学','0','','11','209','江苏省/扬州市','全体学员','毕业证书','100','0','0','扬州大学成人教育招生办法\r\n\r\n为深化成人高校招生改革，认真贯彻落实十八届三中全会决定的精神，以“转型、互补、拓展”为主线，积极探索“分类考试、综合评价、多元录取”的成人高校考试招生制度改革。积极推进成人高校招生服务经济建设和社会发展的转型，积极推进分类考试、自主招生改革，进一步深化艰苦行业和校企合作试点项目改革，探索减少全国统考科目、调整考试内容，实行“文化基础+技术技能”的考试模式，努力提升面向现代农业、现代服务业、战略性新兴产业等领域人才的选拔与培养能力，满足在职从业人员学习需求，为我省选拔和培养更多职业化、应用型人才。现面向全省招生。\r\n扬州大学成人高等学历教育的目前主要办学层次是专科起点本科、高中起点本科。主要学习形式有：函授、业余（夜大学）。\r\n考生通过网上报名，市县招办确认，参加全国成人高考，经由省考试院批准录取后，可到我校参加学习。\r\n学习成绩合格的毕业生，可取得国家承认学历的国民教育系列的成人高等教育毕业文凭（教育部电子注册）。本科专业的毕业生符合学士学位授予条件的，学校可授予相应的学士学位。\r\n扬州大学成人高等学历教育实行校院两级管理，扬州大学继续教育处(学院)是学校管理职能部门, 成人高等学历教育由教学管理科归口管理。\r\n详情请登录扬州大学继续教育处（学院）查看。','0','1438944734','1525258334','1438944734','0','0','','1','1','15','扬州大学成人教育招生 扬州方通教育信息咨询有限公司  毕业证书 扬州00 大学00 学成00 成人00 人教00 教育00 招生00 信息00 咨询00 有限00 公司00 毕业00 毕业证0 证书00 函授00 江苏00 江苏省0 州市00 招生办0 办法00 深化00 化成00 高校00 改革00 认真00 贯彻00 落实00 十八00 三中00 全会00 决定00 精神00 转型00 互补00 拓展00 为主00 主线00 积极00 探索00 分类00 考试00 综合00 评价00 多元00 录取00 推进00 服务00 服务经0 经济00 建设00 社会00 发展00 自主00 进一步0 艰苦00 苦行00 行业00 校企00 合作00 试点00 项目00 减少00 全国00 统考00 科目00 调整00 内容00 实行00 文化00 基础00 技术00 技能00 模式00 努力00 提升00 面向00 现代00 农业00 服务业0 战略00 战略性0 新兴00 产业00 领域00 人才00 选拔00 培养00 能力00 满足00 在职00 从业00 业人员0 人员00 学习00 需求00 我省00 更多00 职业00 职业化0 应用00 应用型0 全省00 省招生0 高等00 学历00 目前00 主要00 办学00 层次00 专科00 起点00 本科00 高中00 形式00 业余00 夜大00 夜大学0 考生00 通过00 网上00 上报00 报名00 市县00 招办00 确认00 参加00 高考00 经由00 考试院0 批准00 我校00 成绩00 合格00 毕业生0 可取00 取得00 国家00 承认00 国民00 教育系0 系列00 业文00 文凭00 教育部0 电子00 注册00 专业00 符合00 学士00 士学位0 学位00 授予00 条件00 管理00 继续00 教育处0 学院00 学校00 职能00 部门00 教学00 教学管理 管理科0 理科00 归口00 详情00 登录00 查看00','扬州大学成人教育招生,扬州方通教育信息咨询有限公司,,毕业证书','','0.000000','0.000000','1','4','0');
INSERT INTO `qs_course` VALUES ('1401','0','69699','郑州景观设计培训 室内培训班','2','郑州景尚景观设计有限公司','89','20','其他技能培训','1880','随到随学','0','','17','278','河南省/郑州市','大学生以及景观爱好者','','3个月','6000','5300','二、景观设计  \r\n1、设计规划分析\r\n2、景观设计实践\r\n3、CAD总平面制图\r\n4、PS平面和立面制图\r\n5、大场景3D室外效果图制作及VRAY渲染器\r\n6、后期PS处理\r\n7、就业指导\r\n一、室内装饰设计\r\n1、室内设计概论 2、装饰设计风格 3、人休工程学 4、家居风水\r\n5、装饰材料大全 6、施工工艺及施工管理的国际规范 7、房屋测量 8、工程设计实践 9、谈单经验 10、工程报价制作 11、CAD方案图，国际标准施工图绘制 12、3DMAX高级效果图及VRAY渲染器 13、室内效果PS后期处理 14、施工技术操练 15、就业指导 16、色彩搭配  17、上色手绘效果图','0','1438960475','1441552475','1438960475','0','0','','1','1','1','郑州景观设计培训 室内培训班 郑州景尚景观设计有限公司  郑州00 景观00 景观设计 设计00 培训00 室内00 培训班0 有限00 公司00 其他00 技能00 河南00 河南省0 郑州市0 州市00 规划00 划分00 分析00 实践00 AD000 平面00 制图00 立面00 场景00 室外00 效果00 效果图0 效果图制作 图制00 制作00 渲染00 后期00 处理00 就业00 指导00 装饰00 室内设计 内设00 概论00 风格00 工程00 工程学0 家居00 风水00 饰材00 材料00 大全00 施工00 工艺00 施工管理 管理00 国际00 规范00 房屋00 测量00 工程设计 经验00 报价00 方案00 标准00 施工图0 绘制00 高级00 技术00 操练00 色彩00 搭配00 上色00 手绘00','郑州景观设计培训 室内培训班,郑州景尚景观设计有限公司,,','','113.779843','34.788224','1','1','0');
INSERT INTO `qs_course` VALUES ('1402','0','69737','汽车估损师高级职业资格认证考试','2','徐州市银地东大职业培训学校','29','16','汽车培训','1881','白天班','0','','11','202','江苏省/徐州市','各车辆保险公司定损人员，公估公司专业公估人员，二手车鉴定评估人员，资产评估机构评估人员，维修企业接待','人保部（原劳动和社会保障部）职业技能鉴定中心授予全国统一的《','80','0','0','三、培训对象\r\n各车辆保险公司定损人员，公估公司专业公估人员，二手车鉴定评估人员，资产评估机构评估人员，维修企业接待、理赔人员,4S店事故查勘人员及其他从事机动车销售、租赁、拍卖、典当、置换、回收业务的企事业单位从业人员。\r\n四、培训与考核方式\r\n&#160;&#160;&#160;   采用周末或脱产形式培训，时间不少于80课时，学员要参加系统培训和统一考核。考核内容依据中华人民共和国劳动和社会保障部鉴定中心制定的认证标准，及标准所规定的知识和技能要求具体确定，考试时间定于2015年3月、5月、6月、8月、10月、12月中下旬。由人保部（原劳动和社会保障部）职业技能鉴定中心授予全国统一的《汽车估损师高级职业资格》，并颁发认证OSTA证书。具体报名事宜详询东大职业学校\r\n五、报名条件\r\n1、取得中等职业学校汽车相关专业毕业证书或同等以上学历，并连续从事两年以上汽车碰撞修复或估损工作。\r\n2、取得汽车相关专业本科或同等以上学历的人员。\r\n（符合以上条件之一者均可报名）证书颁发与作用\r\n鉴定合格者，可获得由人力资源和社会保障部职业技能鉴定中心颁发的《中华人民共和国汽车估损师OSTA证书》。该证书是国家直接出具的从业者上岗和任职的职业资格证明，全国联网查询、全国通用。','0','1438998253','1464918253','1438998253','0','0','','1','1','8','汽车估损师高级职业资格认证考试 徐州市银地东大职业培训学校  人保部（原劳动和社会保障部）职业技能鉴定中心授予全国统一的《汽车估损师高级职业资格》，并颁发认证OSTA证书 汽车00 高级00 职业00 资格00 认证00 考试00 徐州00 州市00 东大00 培训00 学校00 人保00 劳动00 社会00 保障00 技能00 鉴定00 中心00 授予00 全国00 统一00 颁发00 证书00 江苏00 江苏省0 对象00 车辆00 保险00 公司00 人员00 专业00 二手00 二手车0 评估00 资产00 机构00 维修00 企业00 接待00 理赔00 事故00 查勘00 及其00 及其他0 其他00 从事00 机动00 机动车0 动车00 销售00 租赁00 拍卖00 典当00 置换00 回收00 业务00 企事业0 事业00 单位00 从业00 业人员0 考核00 方式00 采用00 周末00 脱产00 形式00 学员00 参加00 系统00 内容00 依据00 中华00 华人00 人民00 共和00 制定00 标准00 规定00 知识00 要求00 具体00 确定00 月中00 中下00 中下旬0 下旬00 报名00 事宜00 条件00 取得00 中等00 相关00 毕业00 毕业证0 同等00 以上00 上学00 学历00 连续00 上汽00 碰撞00 修复00 工作00 本科00 符合00 之一00 作用00 合格00 合格者0 获得00 人力00 人力资源 资源00 国家00 直接00 出具00 从业者0 业者00 上岗00 任职00 资格证0 证明00 联网00 查询00 通用00','汽车估损师高级职业资格认证考试,徐州市银地东大职业培训学校,,人保部（原劳动和社会保障部）职业技能鉴定中心授予全国统一的《汽车估损师高级职业资格》，并颁发认证OSTA证书','','0.000000','0.000000','1','1','0');
